	[1001] = {
		Title = "Cambio de clase a Acólito",
		Description = {
			"Hablaste con el padre Mareusis para pertenecer a la clase Acólito. Te ordenó visitar al ^000077padre Rubalkabara^000000, que ha estado practicando el ascetismo cerca de las reliquias, al noreste de la ciudad de Prontera."
