	},
	[1002] = {
		Title = "Cambio de clase a Acólito",
		Description = {
			"Hablaste con el padre Mareusis para pertenecer a la clase Acólito. Te ordenó visitar a la ^000077madre Matilda^000000, que ha estado practicando el ascetismo cerca del pueblo de Morroc, al suroeste de Prontera."
