		Summary = "Habla con el padre Yosuke."
	},
	[1004] = {
		Title = "Cambio de clase a Arquero",
		Description = {
			"Para convertirte en arquero, debes recibir una calificación de al menos ^0000FF25^000000 puntos sobre 40. Puedes conseguir Troncos de los monstruos Sauce, pero debes tener cuidado, pueden ser monstruos rudos."
		},
		Summary = "Recolecta Troncos y preséntate ante el Arquero del gremio."
	},
	[1005] = {
		Title = "Cambio de clase a Mago",
		Description = {
