	[1009] = {
		Title = "Cambio de clase a Comerciante",
		Description = {
			"Recoge el Paquete de entrega en el mercado y luego ve a la antigua Asociación de Espadachines de Prontera. Cuando llegues, visita a la empleada de Kafra que está allí. Se llama Blossom."
		},
		Summary = "Lleva el Paquete a Prontera."
	},
	[1010] = {
		Title = "Cambio de clase a Comerciante",
		Description = {
			"Recoge el Paquete de entrega en el almacén y luego ve a reunirte con el Mago del gremio de Geffen. Cuando llegues allí, visita al Mago del gremio a cargo."
		},
		Summary = "Entrega el Paquete al gremio de Magos de Geffen."
	},
	[1011] = {
		Title = "Cambio de clase a Comerciante",
		Description = {
			"Recoge el Paquete de entrega en el mercado y luego ve a Morroc. Allí debes buscar a Java Dullihan, el fabricante de tintes. Es un poco olvidadizo, así que quizá deberías darle el Paquete a uno de sus estudiantes."
		},
		Summary = "Entrega el Paquete al fabricante de tintes de Morroc."
	},
	[1012] = {
		Title = "Cambio de clase a Comerciante",
		Description = {
			"Recoge el Paquete de entrega en el mercado y luego entrégaselo a la empleada de Kafra que se encuentra en la isla Byalan."
		},
		Summary = "Entrega el Paquete y el mensaje a la chica de Kafra en la isla Byalan."
	},
	[1013] = {
		Title = "Cambio de clase a Ladrón",
		Description = {
			"Roba Hongos de la granja de Shibu. Reúne 2 tipos de hongos: ^0000FFHongo de red naranja^000000 que otorga 3 puntos y ^0000FFHongo pegajoso naranja^000000 que otorga 1 punto. Necesitas un total de 25 puntos para superar la prueba. Dirígete hacia el campo este de las pirámides."
		},
		Summary = "Reúne Hongos de red naranja y Hongos pegajosos naranja."
	},
	[1014] = {
		Title = "Cambio de clase a Espadachín",
		Description = {
			"El objetivo de esta prueba es confirmar si tienes lo que se necesita para pertenecer a la clase Espadachín. Ahora bien, las condiciones para completar esta prueba son muy sencillas. Recorrerás tres trayectos y deberás llegar al punto de control final en ^FF000010 minutos^000000."
		},
		Summary = "Llega al punto de control final."
	},
	[1015] = {
		Title = "Tu primera misión",
		Description = {
			"Recibiste un Bao. Es un sabroso bollo que los eruditos orientales comen por tradición antes de estudiar. Hace poco, estos eruditos descubrieron que un estómago lleno de Bao conduce a la existencia de la lógica."
		},
		Summary = "Habla con Cicero, el tutor que guía las misiones, y asegúrate de tener aún el Bao."
	},
	[1016] = {
		Title = "Gana niveles de base",
		Description = {
			"Mata a tantos monstruos como puedas para ganar 2 niveles de base y así completar tu entrenamiento de combate de campo. Asegúrate de hablar con el personal del norte después de aumentar tu nivel de base en 2."
		},
		Summary = ""
	},
