	},
	[1110] = {
		Title = "Lope y Euridi: Víctimas de la niebla",
		Description = {
			"Encontraste a alguien llamado Pitt que cree que Lope sigue con vida en alguna parte, pero no sabe con seguridad dónde."
		},
		Summary = "Vuelve con Euridi y cuéntale lo que descubriste."
	},
	[1111] = {
		Title = "Lope y Euridi: La niebla forestal",
		Description = {
			"Busca ^0000FFPistas de Lope^000000 en el bosque y llévaselas a Pitt. Si reúnes 30, será suficiente."
		},
		Summary = ""
	},
	[1112] = {
		Title = "Lope y Euridi: Laberinto",
		Description = {
			"Pitt no está siendo de mucha ayuda. Debes llevarle las Pistas de Lope a Euridi y verificar si puede hacer algo con ellas."
		},
		Summary = ""
	},
	[1113] = {
		Title = "Lope y Euridi: Promesa rota",
		Description = {
			"Tras unir las Pistas, es evidente que Pitt tuvo algo que ver con lo que le pasó a Lope…"
		},
		Summary = ""
	},
	[1114] = {
		Title = "Lope y Euridi: El costo del sacrificio",
		Description = {
