		},
		Summary = ""
	},
	[1115] = {
		Title = "Lope y Euridi: Canción del abismo",
		Description = {
			"Mientras Euridi le canta una canción a Lope, la amiga de Euridi dice que le hablaron de un hombre sospechoso cerca de la entrada del bosque."
		},
		Summary = ""
	},
	[1116] = {
		Title = "Lope y Euridi: Canción de los muertos",
		Description = {
			"Encuentras a Lope, pero te pide que le digas a Euridi que él se convirtió en polvo. Ya no puede estar con ella como querían."
		},
		Summary = ""
	},
	[1117] = {
		Title = "Lope y Euridi: Promesa de eternidad",
		Description = {
			"Euridi toma bastante mal la noticia sobre Lope cuando le das el Anillo de Lope…"
		},
		Summary = "Habla con la amiga de Euridi."
	},
	[1118] = {
