	[1145] = {
		Title = "¡Ayuda a los gatos malos en peligro!",
		Description = {
			"Hazle un favor a Gobongee, que tiene el estómago revuelto. Ve al puerto e intenta escuchar la conversación sospechosa."
		},
		Summary = "Cerca del gato tonto."
	},
	[1146] = {
		Title = "¡Ayuda a los gatos malos en peligro!",
		Description = {
			"Escuchaste a los traficantes sospechosos hablar sobre el objeto oculto. Comprueba la zona alrededor del bolso de globos que está al norte del barco Navi."
		},
		Summary = ""
	},
	[1147] = {
		Title = "¡Ayuda a los gatos malos en peligro!",
		Description = {
