		},
		Summary = "Cerca del gato tonto."
	},
	[1148] = {
		Title = "¡Ayuda a los gatos malos en peligro!",
		Description = {
			"Por la conversación de los traficantes sospechosos, te diste cuenta de que el lugar oculto es el propio barco Navi. Busca otro gato sospechoso en la cubierta de la nave Navi."
		},
		Summary = "Cubierta del barco Navi."
	},
	[1149] = {
		Title = "¡Ayuda a los gatos malos en peligro!",
		Description = {
