	[5856] = {
		Title = "Me llamo Mañana",
		Description = {
			"“¡Saludos a quien esté leyendo esto! Debo ir a un sitio a toda prisa y tuve que dejar atrás a este chico que estás viendo, un sujeto de prueba abandonado aquí en Rudus. Puedes llamarlo <NAVI>[Mañana] <INFO>sp_rudus, 130, 200, 0, 101, 0</INFO></NAVI>. No lo abandono del todo. Vendré a verlo siempre que pueda. Mientras tanto, ¿te importaría alimentarlo con regularidad? Como no puedo traerlo conmigo por ahora, dale lo que él quiera. ¡Gracias por tu ayuda!”. - Olg"
		},
		Summary = ""
	},
	[5857] = {
		Title = "Mañana amistoso",
		Description = {
			"“¡Saludos a quien esté leyendo esto! Gracias por alimentar a Mañana. El otro día le hablé de los Porings, quizá por eso ahora está obsesionado con ellos. No estaría tan solo si tuviera un Poring como mascota. ¿Podrías conseguirle un <ITEM>[Huevo de Poring] <INFO>9001</INFO></ITEM>? ¡Te lo agradezco mucho!”. - Olg"
		},
		Summary = "Huevo de Poring."
	},
	[5858] = {
		Title = "Mañana amistoso",
		Description = {
			"“¡Hola, colega! Parece que Mañana ahora te reconoce como la mano que le da de comer. Ah, solo estoy bromeando. Hace un tiempo, le hablé del saltamontes que canta, el Rockero. Ahora, quiere verlo. ¿Podrías conseguirle un <ITEM>[Huevo de Rockero] <INFO>9011</INFO></ITEM> esta vez? ¡Te lo agradezco mucho!”. - Olg"
		},
		Summary = "Huevo de Rockero."
	},
	[5859] = {
		Title = "Mañana amistoso",
		Description = {
			"“¡Hola, colega! Le conté la historia de las ‘Aventuras del pollito’, quizá por eso ahora siente curiosidad por los Picky. ¿Podrías conseguirle un <ITEM>[Huevo de Picky] <INFO>9005</INFO></ITEM> esta vez? Como no puedo estar todo el tiempo con él, al menos quiero que tenga tantos amigos a su alrededor como pueda conseguir. ¡Te lo agradezco mucho!”. - Olg"
		},
		Summary = "Huevo de Picky."
	},
	[5860] = {
		Title = "Mañana amistoso",
		Description = {
			"“¡Hola, colega! Siento seguir pidiéndote favores. Le hablé del conejo que vive en la luna y ahora siente curiosidad por las Lunáticas. ¿Podrías conseguirle un <ITEM>[Huevo de Lunática] <INFO>9004</INFO></ITEM>? ¡Te lo agradezco mucho!”. - Olg"
