	[7026] = {
		Title = "En busca de Rayan Moore",
		Description = {
			"El pergamino está desbloqueado. ^4d4dfforganizations La organizaciones suelen usar dichos pergaminos para reunir a sus miembros^000000. Dice que deberías usarlo ahora, pero cabe preguntarse si deberías hablar con el Sr. Kidd primero."
