	},
	[7037] = {
		Title = "¿Caso cerrado?",
		Description = {
			"El caso ya está cerrado, pero ¿qué te sigue rondando por la cabeza? Deberías preguntar a alguien sobre la solicitud de Diente de León porque Echinacea no está siendo de mucha ayuda."
		},
		Summary = ""
	},
	[7038] = {
		Title = "Pasión por las Batatas asadas",
		Description = {
			"Consultaste a Defaria sobre tu preocupación, pero solo recibiste la tarea de reunir algunos materiales para asar Batatas…"
		},
		Summary = "20 Batatas y 30 Leños."
	},
	[7039] = {
		Title = "Por la tangente",
		Description = {
			"Interrogaste a Defaria una y otra vez y parece que ya empezó a hablar de Diente de León. Sin embargo, volvió a cambiar de tema y te pidió que le entregaras unas Batatas al Sr. Kidd."
