		Summary = "Entrega 2 Batatas a Echinacea."
	},
	[7041] = {
		Title = "La política es para los políticos",
		Description = {
			"Echinacea aconseja dejar de cuestionar los motivos de los políticos y confiar en que harán lo que más convenga para mantener la paz. Vuelve con Defaria y agredécele por las Batatas."
