		Summary = "Defaria."
	},
	[7042] = {
		Title = "Trabajo a medio tiempo: Alimentación de Tatacho",
		Description = {
			"Por favor, tráeme 50 Pescados frescos. Son el alimento para los Tatacho. Se me acabaron y tendré que reabastecerme muy pronto. Puedes conseguirlos cazando monstruos Tatacho en los campos."
		},
		Summary = "50 Pescados frescos."
	},
	[7043] = {
		Title = "Trabajo a medio tiempo: Alimentación de Cornus",
		Description = {
			"Se acabó el alimento para los Cornus. ¿Puedes traerme 30 Hojas enormes y 30 Raíces terrosas? Puedes conseguirlas cazando monstruos Pinguicula en los campos."
		},
		Summary = "30 Hojas enormes y 30 Raíces terrosas."
	},
	[7044] = {
		Title = "Trabajo a medio tiempo: Alimentación de León de montaña 1",
		Description = {
			"Se acabó el alimento para los Leones de montaña. Los Eruditos creen que estos monstrus son de la familia gatuna. He intentado alimentarlos con varias cosas… Esta vez me gustaría intentar con Comida para monstruos. ¿Puedes traerme 20 unidades de Comida para monstruos y 30 unidades de Comida para mascotas?"
		},
		Summary = "20 unidades de Comida para monstruos y 30 unidades de Comida para mascotas."
	},
	[7045] = {
		Title = "Trabajo a medio tiempo: Alimentación de León de montaña 2",
		Description = {
			"Esto es perfecto porque iba a probar con comida para Leones de montaña. Intenté darles Comida para monstruos, pero no sé si les gustó o no. ¿Puedes traerme 50 unidades de Carne y 30 unidades de Comida para mascotas?"
		},
		Summary = "50 unidades de Carne y 30 unidades de Comida para mascotas."
	},
	[7046] = {
		Title = "Trabajo a medio tiempo: Alfombras calientes",
		Description = {
			"Siempre quise poner algo caliente en el suelo para mis criaturas. ¿Puedes traerme 30 pedazos de Piel?"
		},
		Summary = "30 pedazos de Piel."
	},
	[7047] = {
		Title = "Trabajo a medio tiempo: ¡Todo listo por hoy!",
