		Summary = "Investiga el tercer piso de la torre."
	},
	[7049] = {
		Title = "Torre de Thanatos: Torre sellada",
		Description = {
			"Obtuviste la Llave roja mientras investigabas el Dispositivo rúnico. El mensaje que viste al desbloquear se te quedó metido en la cabeza. Parece que hay unos cuantos dispositivos más de este tipo."
		},
		Summary = "Busca otros Dispositivos rúnicos dentro de la torre."
	},
	[7050] = {
		Title = "Torre de Thanatos: Torre sellada",
		Description = {
			"Encontraste la segunda Llave del sello. Parece que quedan más sellos. Debo buscar la forma de águila en el piso 5."
		},
		Summary = "Busca la forma de águila en el piso 5."
	},
	[7051] = {
		Title = "Torre de Thanatos: Torre sellada",
		Description = {
			"Parece que la Torre de Thanatos se usaba como puerta de paso. Tienes la corazonada de que hay más de estos sellos para la puerta y algunos otros que desconoces."
		},
		Summary = "Explora el piso 6 de la torre."
	},
	[7052] = {
		Title = "Torre de Thanatos: Torre sellada",
		Description = {
			"Tienes la cuarta Llave. Parece que forzaron el paso al Devildom para conectar con otro lugar. Quizá esto tenga algo que ver con los monstruos que aparecen en la torre."
