	[7056] = {
		Title = "Mensajero: El favor de Arc",
		Description = {
			"En el puesto de los laphines, Splendide, conociste al laphine Arc, que te pidió que buscaras a su amiga, Terra.  Él dice que Terra suele dejar rastros atando las plantas con nudos."
