	},
	[7174] = {
		Title = "Criptograma misterioso",
		Description = {
			"La pista que tenía Halled era una canción breve. Necesito encontrar el lugar que indica esta canción. [^4d4dffFina raíz del Árbol de la vida / Lágrimas de los vivos / Fueron, pero no fuimos / Habitantes de la noche olvidada."
