	},
	[7183] = {
		Title = "Invitación del sapha",
		Description = {
			"Obtén el permiso de Avalanche, el guardia general en Manuk, para atravesar el túnel entre Manuk y la capital sapha, El Dicastes."
		},
		Summary = "Conoce a Avalanche en Manuk."
	},
	[7184] = {
		Title = "¡Hacia El Dicastes!",
		Description = {
			"Avalanche te ha autorizado a usar el túnel entre Manuk y El Dicastes. ¡Por fin podré ir a la capital de los saphas! Visita al administrador en la entrada del túnel en Manuk."
		},
		Summary = ""
	},
	[7185] = {
		Title = "Inspector Doha",
		Description = {
			"Antes de salir a la capital, el capitán Hibba Agip me dijo que visite al inspector Doha. No sé para qué, pero tengo que encontrarme con esta persona de Doha antes de ir a Manuk. Doha está en la sala al costado de la de Vyhannus."
		},
		Summary = "Reúnete con el inspector Doha."
	},
	[7186] = {
		Title = "Orden secreta de Doha: investigación ",
		Description = {
			"Doha dice que está buscando al sospechoso del caso del informe robado. Te ordena en secreto que recolectes información mientras estás en El Dicastes y te describe el atuendo del sospechoso. Es una persona con orejas de animal."
		},
		Summary = ""
	},
	[7187] = {
		Title = "Orden secreta de Doha: Shay",
		Description = {
			"Shay es el administrador de “Burman Flone”, el bar de El Dicastes. Sugirió preguntar al sapha que vive en la capital sobre “el tipo con orejas de animal”."
		},
		Summary = "Conversa con el sapha en El Dicastes para obtener información."
	},
	[7188] = {
		Title = "Recopilación de información: En la plaza",
		Description = {
			"¿Orejas de gato? ¿No hay comerciantes de Pata de gato? No tengo ni idea. Por cierto, ¿ya conoces a Ahat? Es realmente hermoso y noble."
		},
		Summary = ""
	},
	[7189] = {
		Title = "Recopilación de información: En la fábrica",
		Description = {
			"¿Un hombre con orejas de gato? No sé nada al respecto. No trates de encontrar ese tipo de cosas poco creíbles y simplemente anda a visitar a Ahat. ¡Es muy simpático! ¡Es un ejemplo a seguir para los saphas!"
		},
		Summary = ""
	},
	[7190] = {
		Title = "Recopilación de información: Con los guardias",
		Description = {
			"¿Orejas de gato? ¿De verdad? ¿Los humanos son siempre así? ¿Por qué no vas a ver a Ahat? Es un sapha muy fuerte. Puede parecer un Jarute enterrado en montones de documentos, ¡pero debe estar escondiendo su poder!"
		},
		Summary = ""
	},
	[7191] = {
		Title = "Designación de Shay: BK",
		Description = {
			"Para facilitar la recopilación de información, Shay presentó a BK, de los Comerciantes de Mano de gato. Tienes que decirle a BK que ^4d4dff“la bebida especial de Shay será entregada”^000000 si BK no ofrece ninguna ayuda…"
		},
		Summary = "Reúnete con BK en las afueras de la montaña Kamidal, en las afueras de El Dicastes."
	},
	[7192] = {
		Title = "Información de BK",
		Description = {
			"Según la información de BK, el hombre de las orejas de gato está estrechamente relacionado con Ahat, el hombre célebre de El Dicastes. Pero dijo que Ahat no es un sapha y que lo encontraron cerca de la grieta. ¿En qué están relacionados?"
		},
		Summary = "Comenta tus hallazgos con Shay en Burman Flone."
	},
	[7193] = {
		Title = "Investigación de la grieta dimensional",
		Description = {
			"Después de hablar con Shay, investiga la zona cercana a la brecha del sur para descubrir la verdad. Encuentra cualquier pista que pueda ser útil para la investigación."
		},
		Summary = "Investiga la zona de la grieta dimensional al sur."
	},
	[7194] = {
		Title = "¿Qué es esta mancha de sangre?",
		Description = {
			"Encontré sangre coagulada en la tierra cerca de la grieta. ¿Tiene esto algo que ver con Ahat?"
		},
		Summary = ""
	},
	[7195] = {
		Title = "¿Qué es este Trozo de piel?",
		Description = {
			"Encontré un Trozo de piel congelada de un ser vivo cerca de la grieta. ¿Tiene esto algo que ver con Ahat?"
		},
		Summary = ""
	},
	[7196] = {
		Title = "¿Qué es este intrigante poder mágico?",
		Description = {
			"Encontraste un fragmento sospechoso de piedra mágica. Se siente como el poder mágico de la grieta. ¿Tiene esto algo que ver con Ahat?"
		},
		Summary = ""
	},
	[7197] = {
		Title = "¿Certificación sapha?",
		Description = {
			"No es necesario traer Certificaciones sapha para obtener una audiencia con Ahat. Completa algunas de las misiones que puedes encontrar por toda la capital y recoléctalas."
		},
		Summary = "Recolecta 3 Certificaciones saphas."
	},
	[7198] = {
		Title = "Audiencia con Ahat",
		Description = {
			"Puedes tener una audiencia con Ahat a cambio de 3 Certificaciones saphas. Puedes reunirte con Ahat después de subir a la oficina de administración en Dicastes Diel."
		},
		Summary = ""
	},
	[7199] = {
		Title = "Orden secreta de Ahat",
		Description = {
			"Ahat te ordenó eliminar varios rastros alrededor de la grieta. Recolecta 10 unidades de cada uno de estos objetos: Mancha de sangre coagulada, Trozo de piel congelada y Piedra mágica extraña."
		},
		Summary = ""
	},
	[7200] = {
		Title = "Llamada de Cheshire",
		Description = {
			"Realiza los trabajos de extracción poco a poco para no levantar sospechas. Reúnete con Cheshire en la oficina de administración cuando sea la hora adecuada."
		},
		Summary = "Espera a que el temporizador termine y habla con Cheshire."
	},
	[7201] = {
		Title = "Eliminación de los rastros",
		Description = {
			"Elimina los rastros de la grieta dimensional alrededor de la zona sureste de las afueras de la montaña Kamidal. Recolecta 10 unidades de cada uno de estos objetos: Mancha de sangre coagulada, Trozo de piel congelada y Piedra mágica extraña."
		},
		Summary = ""
	},
	[7202] = {
		Title = "Orden secreta de Doha: recolección de pruebas",
		Description = {
			"Sin que Cheshire y Ahat lo noten, oculta todos los rastros de la grieta para presentarlas a Doha como evidencia y agrégalo al informe. Recolecta 1 Mancha de sangre coagulada, 1 Trozo de piel congelada y 1 Piedra mágica extraña."
		},
		Summary = ""
	},
	[7203] = {
		Title = "Orden secreta de Doha: El informe final",
		Description = {
			"Hablaste con Jarute HesLanta sobre varios temas. Tras hablar con HesLanta, escribe tus hallazgos en un informe para Doha, y llévalo al campamento de la expedición."
		},
		Summary = "Lleva tu informe final al inspector Doha."
	},
	[7204] = {
		Title = "Flor que trae la primavera",
		Description = {
			"Conocí a “Bomi” en Lutie, que quería saber sobre la Flor que trae la primavera. Le prometí que le llevaría un ramo con la Flor de primavera. Puede ser suficiente con 5 unidades de [Gran rocío de flor].."
		},
		Summary = "Regala a Bomi la primavera."
	},
	[7206] = {
		Title = "Los nuevos días de Cheshire",
		Description = {
			"Encontrarás a un miembro de Pata de Gato si lo buscas en el centro del ^4d4dffTúnel de Kamidal^000000. ^4d4dffEn el lado oeste de la entrada del salón Skaraba hay una caja de mercancías marcada^000000. Muévela, por favor. En la caja, se indica el lugar a donde debe llevarse."
		},
		Summary = ""
	},
	[7207] = {
		Title = "Caja de Cheshire",
		Description = {
			"Encontraste la caja de la que hablaba Cheshire en el Túnel de Kamidal. En la parte inferior de la caja, en letras pequeñas, dice ^4d4dffFrente a la grieta de Bifrost^000000. Tendrás que llevarla a Cheshire, que puede estar en cualquier parte de Bifrost."
		},
		Summary = ""
	},
	[7208] = {
		Title = "¿Y mañana también, por favor?",
		Description = {
			"Aceptaste ayudar a transportar la caja cargada a Cheshire al Túnel de Kamidal una vez al día. Cuando llegue el momento, ve a buscar la caja."
		},
		Summary = ""
	},
	[7209] = {
		Title = "Se perdió la caja",
		Description = {
			"La caja se extravió. En lugar de la caja, Cheshire te pide que consigas 20 unidades de Bradium refinado."
		},
		Summary = "Bradium refinado: 20 unidades."
	},
	[7210] = {
		Title = "Entrega diaria",
		Description = {
			"Cheshire está esperando la caja de Bradium. Debes llevar los objetos de hoy a Cheshire, que está esperando en Bifrost."
		},
		Summary = ""
	},
	[7211] = {
		Title = "Explora el Bosque neblinoso",
		Description = {
			"Explora el Bosque neblinoso. El Bosque neblinoso te recuerda, así que si vuelves a intentar entrar, podría expulsarte."
		},
		Summary = ""
	},
	[7212] = {
		Title = "Encuentro con Loki",
		Description = {
			"Por casualidad, conociste a un hombre llamado Loki en el bosque y está buscando a alguien. Jarani de cabello morado. ¿Qué significa esto? Si lo descubres, ¿deberías contárselo a Loki?"
		},
		Summary = ""
	},
	[7213] = {
		Title = "Protector errante",
		Description = {
			"Loki buscaba al guardián de Niddhog, que deambulaba por la niebla.  Cuando salgas del bosque, decidiste reunirte en el pueblo de Mora."
		},
		Summary = ""
	},
	[7214] = {
		Title = "Entrenamiento avanzado en Comodo",
		Description = {
			"Busca la cueva situada al norte. Ahí hay alguien llamado <NAVI>[Romeo]<INFO>comodo,173,354,0,101,0</INFO></NAVI>. Ya sabes, como Romeo de “Romeo y Julieta”."
		},
		Summary = "Encuentra y habla con Romeo."
	},
	[7215] = {
		Title = "Cacería de Gólem de estalactita",
		Description = {
			"Hay una cueva al norte de Comodo que tiene monstruos enormes. No debe ser complicado cazar 3."
		},
		Summary = "Caza 3 Gólem de estalactita y regresa con Romeo en Comodo."
	},
	[7216] = {
		Title = "Más cacería de Gólem",
		Description = {
			"Ahora que has demostrado tu valía, caza otros 10 Gólem de estalactita para que los viajantes puedan transitar con seguridad por la cueva."
		},
		Summary = "Caza 10 Gólem de estalactita y regresa con Romeo en Comodo."
	},
	[7217] = {
		Title = "Botines en el campo",
		Description = {
			"El instructor <NAVI>[Romeo]<INFO>um_fild01,34,280,0,101,0</INFO></NAVI> te pidió que le lleves materiales tras la cacería de Wootan y Dríadas en el campo al norte de la cueva de Comodo."
		},
		Summary = "Encuentra 5 Protectores de hombros y 7 Hojas afiladas."
	},
	[7218] = {
		Title = "Informa al instructor Ur",
		Description = {
			"Tus tareas para el paso 1 terminaron por ahora, así que vuelve a la sede del Grupo de Edén y habla con el instructor Ur."
		},
		Summary = "Informa esto al instructor Ur en la sede del Grupo de Edén."
	},
	[7219] = {
		Title = "Entrenamiento avanzado en Glastheim",
		Description = {
			"Cerca de Geffen, hay una zona conocida como <NAVI>[Glastheim]<INFO>glast_01,195,131,0,101,0</INFO></NAVI>, que está infestada de monstruos con propiedad Muerto viviente y Fantasma."
		},
		Summary = "Encuentra y habla con Johan en Glastheim."
	},
	[7220] = {
		Title = "Cacería de Espectros",
		Description = {
			"Haz una cacería de Espectros para ayudar a despejar la abadía."
		},
		Summary = "Caza 20 Espectros y regresa con Johan afuera."
	},
	[7221] = {
		Title = "Cacería de Druidas del mal",
		Description = {
			"Otro monstruo problemático en la abadía son los Druida del mal. Tendrás que cazarlos dentro de la abadía y regresar con Johan."
		},
		Summary = "Caza 10 Druidas del mal."
	},
	[7222] = {
		Title = "Informa al instructor Ur",
		Description = {
			"Tu cacería en Glastheim ayudó a limpiar la abadía. Regresa la sede del Grupo de Edén y habla con el instructor Ur."
		},
		Summary = "Informa esto al instructor Ur en la sede del Grupo de Edén."
	},
	[7223] = {
		Title = "Entrenamiento avanzado en Einbroch",
		Description = {
			"La próxima misión de <NAVI>[entrenamiento]<INFO>ein_fild08,172,359,0,101,0</INFO></NAVI> se realizará en la ciudad industrial de Einbroch, al este de Lighthalzen."
		},
		Summary = "Encuentra al instructor Kiren designado en el campo al sur de Einbroch."
	},
	[7224] = {
		Title = "Cacería de Porcellio",
		Description = {
			"Como calentamiento, busca y caza 30 Porcellio que se arrastran por los campos de Einbroch."
		},
		Summary = "Caza 30 Porcellio y regresa con Kiren en el campo al sur de Einbroch."
	},
	[7225] = {
		Title = "Invisible Quest",
		Description = {
			"Place Holder"
		},
		Summary = "Place Holder"
	},
	[7226] = {
		Title = "Cacería de Venenosos",
		Description = {
			"Hay monstruos verdes y en forma de gas conocidos como Venenosos y están aterrorizando a los trabajadores al norte de Einbroch."
		},
		Summary = "Caza 30 Venenosos."
	},
	[7227] = {
		Title = "Cacería de Ositos de peluche",
		Description = {
			"Los Ositos de peluche no son los adorables peluches para niños. Caza 5 de ellos rápidamente en el campo al norte de Einbroch."
		},
		Summary = "Caza 5 Ositos de peluche."
	},
	[7228] = {
		Title = "Informa al instructor Ur",
		Description = {
			"Terminó tu trabajo en la zona de Einbroch. Regresa la sede del Grupo de Edén y habla con el instructor Ur."
		},
		Summary = "Informa al instructor Ur en la sede del Grupo de Edén."
	},
	[7229] = {
		Title = "Entrenamiento avanzado en la mazmorra de hielo",
		Description = {
			"Si viajas al Norte desde Rachel, encontrarás una cueva en la <NAVI>[mazmorra de hielo]<INFO>ice_dun01,154,13,0,101,0</INFO></NAVI>. Es una larga caminata, pero vale la pena si puedes hacerla."
		},
		Summary = "Encuentra a la instructora designada Naomi en la mazmorra de hielo."
	},
	[7230] = {
		Title = "Cacería de Siroma",
		Description = {
			"Podrías pensar que son enormes bolas de nieve, pero en realidad son monstruos disfrazados."
		},
		Summary = "Caza 30 Siroma y regresa con Naomi cerca de la entrada de la cueva."
	},
	[7231] = {
		Title = "Cacería y recolección",
		Description = {
			"Ahora que ya sabes cómo hacerlo, caza 30 Siroma adicionales y lleva 30 Cubos de hielo, 1 Salsa dulce y 1 Leche."
		},
		Summary = "Caza 30 Siroma y lleva 30 Cubos de hielo, 1 de Salsa dulce y 1 de Leche a Naomi."
	},
	[7232] = {
		Title = "Informa al instructor Ur",
		Description = {
			"Terminaste tu cacería en la mazmorra de hielo. Regresa la sede del Grupo de Edén y habla con el instructor Ur."
		},
		Summary = "Informa al instructor Ur en la sede del Grupo de Edén."
	},
	[7233] = {
		Title = "Entrenamiento avanzado en Ash Vacuum",
		Description = {
			"Dado que estás en la tercera clase, seguro te será fácil luchar contra los monstruos en <NAVI>[Ash Vacuum]<INFO>mid_camp,212,229,0,101,0</INFO></NAVI>."
		},
		Summary = "Encuentra a la instructora designada Margaret en el campamento de expedición de Midgard"
	},
	[7234] = {
		Title = "El favor de Margaret",
		Description = {
			"Margaret te pidió que encuentres a los instructores designados Meeru y Mine. Están en los campos al oeste y otro al este del campamento de la expedición de Midgard."
		},
		Summary = "Encuentra a Meeru y a Mine, completa sus misiones y regresa con Margaret."
	},
	[7235] = {
		Title = "Cacería de Nepenthes",
		Description = {
			"Meeru te pidió que caces 1 Nepenthes en el campo Manuk y regreses a verlo."
		},
		Summary = "Caza 1 Nepenthes y regresar con Meeru."
	},
	[7236] = {
		Title = "Cacería de Pinguicula",
		Description = {
			"Mine te pidió que caces 5 Pinguicula por él."
		},
		Summary = "Caza 5 Pinguicula y regresa con Mine."
	},
	[7237] = {
		Title = "Informa al instructor Ur",
		Description = {
			"Terminó tu entrenamiento en Ash Vacuum. Regresa la sede del Grupo de Edén y habla con el instructor Ur."
		},
		Summary = "Informa al instructor Ur en la sede del Grupo de Edén."
	},
	[7238] = {
		Title = "Tareas para Thorn (fácil)",
		Description = {
			"Thorn necesita materiales para refinar, así que llévale 20 unidades de Mineral de hierro y 10 unidades de Hierro."
		},
		Summary = "Recolecta 20 unidades de Mineral de hierro y 10 unidades de Hierro"
	},
	[7239] = {
		Title = "Tareas para Thorn (difícil)",
		Description = {
			"Thorn necesita materiales para refinar, así que llévale 20 Placas de hierro usadas."
		},
		Summary = "Recolecta 20 Placas de hierro usadas."
	},
	[7240] = {
		Title = "Mejora del equipamiento",
		Description = {
			"Lleva tu nuevo equipamiento del Grupo de Edén a Thorn, pídele que te lo refuerce y te dará una bonificación para el equipamiento."
		},
		Summary = ""
	},
	[7241] = {
		Title = "Tareas para Thorn (en espera)",
		Description = {
			"Espera 24 horas y regresa con Thorn."
		},
		Summary = ""
	},
	[7242] = {
		Title = "Juegos con el gatito",
		Description = {
			"La solicitud de Rato, un marinero experto en gatos de Malangdo. Como se preocupa por los gatitos, te pidió que los encuentres y juegues con ellos. Ve a buscar a los gatitos. La blanca es Rosy, el negro es Roku y la dorada es Charo."
		},
		Summary = ""
	},
	[7243] = {
		Title = "Miauventura: Brújula Duruduru",
		Description = {
			"Los gatitos, que se hacen llamar el “equipo Valentía Miau”, te dieron la Carta de aventura A. Parece que la carta es necesaria para operar algunos dispositivos que ellos fabricaron. Si insertas la carta en la Brújula de inicio, el juego comenzará."
		},
		Summary = ""
	},
	[7244] = {
		Title = "Miauventura: Carrera Duruduru",
		Description = {
			"Comenzó la carrera de la Brújula Duruduru. Debes terminar la carrera en el orden correcto y en el tiempo límite. El orden de la brújula es [Llama roja] -> [Llama azul] -> [Llama dorada] -> [Bosque] -> [Nube]."
		},
		Summary = ""
	},
	[7245] = {
		Title = "Miauventura: Carrera Duruduru",
		Description = {
			"Comenzó la carrera de la Brújula Duruduru. Debes terminar la carrera en el orden correcto y en el tiempo límite. El orden de la brújula es [Llama dorada] -> [Llama azul] -> [Nube] -> [Bosque] -> [Llama roja]."
		},
		Summary = ""
	},
	[7246] = {
		Title = "Miauventura: ¡Allá voy!",
		Description = {
			"Charo dice que un gato detective está cerca del barco Navi que está en el centro de Malangdo. Ve y encuentra al detective y a su amigo."
		},
		Summary = ""
	},
	[7247] = {
		Title = "Miauventura: ¡Detengan la explosión!",
		Description = {
			"Purrlock Holmes, un gato desconfiado que decía ser un “detective de verdad” y su amigo Miauson dicen que, si la máquina de enfrente explota, todo Malangdo acabará destruido. Por lo tanto, te pidieron que detengas la máquina."
		},
		Summary = ""
	},
	[7248] = {
		Title = "",
		Description = {""},
		Summary = ""
	},
	[7249] = {
		Title = "Miauventura: ¡La explosión! Hasta la próxima.",
		Description = {
			"Según Purrlock Holmes y Miauson, esta máquina llamada Explosión causa un problema cada minuto. Nunca sabes cuándo vas a estar en problemas. Mañana vuelve a comprobar la máquina."
		},
		Summary = ""
	},
	[7250] = {
		Title = "Miauventura: ¿Un tesoro escondido?",
		Description = {
			"Cuando Explosión se detiene, Purrlock Holmes y Miauson compartirán contigo una información útil. Están hablando sobre un tesoro. Purrlock Holmes dice que el tesoro está dentro del barco Navi. Puede ser una broma, pero igual vale la pena intentar."
		},
		Summary = ""
	},
	[7251] = {
		Title = "Miauventura: La primera pieza del Cuadro",
		Description = {
			"La pieza del Cuadro que encontraste en la caja del barco Navi."
		},
		Summary = ""
	},
	[7252] = {
		Title = "Miauventura: La segunda pieza del Cuadro",
		Description = {
			"La pieza del Cuadro que estaba en el libro en la sala de reuniones del barco Navi."
		},
		Summary = ""
	},
	[7253] = {
		Title = "Miauventura: La tercera pieza del Cuadro",
		Description = {
			"La pieza del Cuadro que encontraste debajo de la cama vieja en la cabina de la tripulación."
		},
		Summary = ""
	},
	[7254] = {
		Title = "Miauventura: La cuarta pieza del Cuadro",
		Description = {
			"La pieza del Cuadro que encontraste en el caparazón marino decorativo en el cuarto del capitán."
		},
		Summary = ""
	},
	[7255] = {
		Title = "Miauventura: La quinta pieza del Cuadro",
		Description = {
			"La pieza del Cuadro que encontraste en la brecha del pilar de madera."
		},
		Summary = ""
	},
	[7256] = {
		Title = "Miauventura: La sexta pieza del Cuadro",
		Description = {
			"La pieza del Cuadro que encontraste en la ventana de ventilación del suelo de la cabina."
		},
		Summary = ""
	},
	[7257] = {
		Title = "¡Regresa mañana a la carrera Miauventura!",
		Description = {
			"La carrera Duruduru es una buena idea si solo corres una vez al día. Pero si quieres, regresa más tarde."
		},
		Summary = ""
	},
	[7258] = {
		Title = "Miauventura: El Cuadro completado",
		Description = {
			"Encontraste las 6 piezas en el barco. Parece que ya tenemos el Cuadro completo. Ve con Charo, Rosy y Roku para que les avises."
		},
		Summary = ""
	},
	[7259] = {
		Title = "Regalo del equipo Valentía Miau",
		Description = {
			"Charo, Rosy y Roku dicen que quieren regalar a Rato las piezas del Cuadro que encontraste. Lleva el Cuadro a Rato para entregarle el amor de los gatitos (a pesar de que el Cuadro esté destrozado)."
		},
		Summary = ""
	},
	[7260] = {
		Title = "El origen de los bichos",
		Description = {
			"Cleanyang se queja a gritos porque los bichos aparecen una y otra vez, a pesar de limpar el barco completamente. Ayúdalo. Inspecciona cada rincón del barco Navi."
		},
		Summary = ""
	},
	[7261] = {
		Title = "Recoge la Galleta marinera gatuna: Cuarto del capitán",
		Description = {
			"En la esquina del cuarto del capitán, encontraste la Galleta dura de gatos que estaba escondida. La Galleta estaba toda llena de bichos. Los bichos deben haber llegado por la Galleta."
		},
		Summary = ""
	},
	[7262] = {
