		Summary = ""
	},
	[7263] = {
		Title = "Recoge la Galleta marinera gatuna: Sala de reuniones",
		Description = {
			"En algún lugar de la sala de reuniones, encontraste la Galleta dura de gatos que estaba escondida. La Galleta estaba toda llena de bichos. Los bichos deben haber llegado por la Galleta."
