		Summary = ""
	},
	[7264] = {
		Title = "Al chef Miau",
		Description = {
			"Cleanyang sí limpió todo el barco, pero el problema eran esas Galletas duras de gatos que no podía alcanzar. Debes decirle la verdad al chef Miau para que deje de culpar a Cleanyang."
		},
		Summary = "Conversación con el chef Miau."
	},
	[7265] = {
		Title = "La ira del chef Miau",
		Description = {
			"Cuando le contaste la historia de la Galleta y los bichos, el chef se molestó mucho. Será mejor que hables con él un poco más tarde."
		},
		Summary = "Conversación con el chef Miau."
	},
	[7266] = {
		Title = "La declaración del chef Miau",
		Description = {
			"El chef Miau decidió y declaró que a partir de ahora, el gato comerá solo una Galleta dura al día. Te pidió que traigas 10 bolsas de Granos y 1 botella de Salsa sabrosa para preparar las Galletas."
		},
		Summary = "10 bolsas de Granos, 1 botella de Salsa sabrosa. Lleva el mensaje a Cleanyang."
	},
	[7267] = {
		Title = "Hora acordada con Cleanyang",
		Description = {
			"Para resolver el problema de las Galletas duras de gatos, vas a trabajar con Cleanyang. Vuelve con Cleanyang a la hora acordada."
		},
		Summary = ""
	},
	[7268] = {
		Title = "Encuentra las Galletas duras de gatos",
		Description = {
			"Vas a recoger las Galletas que empezaron a esconder los gatos del barco. Si se recogen las Galletas, los bichos también desaparecerán. Concéntrate en los 9 lugares en donde las Galletas suelen aparecer."
		},
