	},
	[7395] = {
		Title = "El fantasma del barco Perry",
		Description = {
			"Decidiste comprobar por tu cuenta si era cierta o no la historia que contó Pedro sobre el barco embrujado. Parece que estos fantasmas me tienen miedo, así que no tengo que temerles."
		},
		Summary = "Investiga el barco Perry."
	},
	[7396] = {
