		Summary = "Habla con Pedro y el mumbaki."
	},
	[7397] = {
		Title = "Consejos de Phong el mumbaki",
		Description = {
			"Phong el mumbaki dijo que no hay que evitar al espíritu, sino que hay que aceptarlo y calmarlo. Busquemos flores para ofrecérselas. Puedes conseguir flores de los animales y monstruos cercanos."
		},
		Summary = "3 Flores sofisticadas, 3 Flores misteriosas, 3 Flores hermosas."
	},
	[7398] = {
		Title = "Ramo de ofrendas recomendado por el mumbaki",
