	},
	[7417] = {
		Title = "La solicitud de Kardui",
		Description = {
			"El mayor Jun no escuchó tus historias sinceras, pero dijo que te escucharía más si contribuyeras a favor de Eclage de forma más significativa. Ayudemos a los laphines que lo necesitan."
