		Summary = "Trabajo para Eclage."
	},
	[7418] = {
		Title = "Por Eclage 1",
		Description = {
			"Consigue ingredientes para decorar el yai del guardia de Eclage, que está muy ocupado. Cuernos de León de montaña, Cuernos místicos y Pezuñas de caballo; 5 de cada uno serían suficientes."
