	},
	[7419] = {
		Title = "Por Eclage 2",
		Description = {
			"Decidiste entregar el correo del oficial de contacto de Splendide como un favor para Roy el mensajero, que estaba teniendo problemas en el borde de Bifrost debido al corte de las comunicaciones."
