	},
	[7420] = {
		Title = "Por Eclage 3",
		Description = {
			"Para Leo, que adora los dulces, llévale de Splendide: Frutas en escabeche de Pinguicula y Mermelada de miel de Luciola. Puedes usar monedas en la base avanzada para obtener las Frutas en escabeche y la Mermelada de miel."
