		},
		Summary = "Recibe el regalo a través de Shinaim."
	},
	[7423] = {
		Title = "Un rumor sobre el Rey 1",
		Description = {
			"Durante la conversación con Leo, se dijeron algunas cosas alarmantes sobre Kardui. No entró en detalles, pero era muy preocupante. "
		},
		Summary = ""
	},
	[7424] = {
		Title = "Un rumor sobre el Rey 2",
		Description = {
			"Fome reveló algo inesperado. Dijo que los laphines están discretamente descontentos con Kardui. Esto se parece a lo que Leo no quería contar."
		},
		Summary = ""
	},
	[7425] = {
		Title = "Un rumor sobre el Rey 3",
		Description = {
			"Después de hablar con los laphines, queda claro que están haciendo una conexión entre Kardui y el despotismo de Cenes. No es demasiado grave, pero es cierto que están viendo al actual rey Kardui de forma parecida a como lo fue Cenes."
		},
		Summary = ""
	},
	[7426] = {
		Title = "Un rumor sobre el Rey 4",
		Description = {
			"Recientemente, pareciera que Kardui se volvió como el mayor Jun en medio de la calamidad que amenaza a toda la raza laphine. No parece que rechazan sus políticas del todo, pero aparentemente tampoco están de acuerdo con ellas."
		},
		Summary = ""
	},
	[7427] = {
		Title = "En momentos así, ¡hay que afrontarlo de frente!",
		Description = {
			"La verdad detrás de la ansiedad y el miedo de los laphines hacia Kardui ya quedó clara. ¿No debería saberlo el monarca? Tal vez sea posible conocer el motivo de todo esto…"
		},
		Summary = "Habla con Kardui."
	},
	[7428] = {
		Title = "Yai de la naturaleza",
		Description = {
			"Consigue objetos para el yai de Minuel, el guardia de Eclage, que está de guardia todos los días y todas las noches."
