			"La carta de Kardui no solo tenía una presentación, sino también una solicitud para buscar a su padre, Avant, el erudito de magia. Ayuda a Hisie a averiguar más sobre el erudito dentro de Eclage."
		},
		Summary = ""
	},
	[7437] = {
		Title = "El favor de Shinaim",
		Description = {
			"No pudiste obtener la información de Avant, pero Shinaim te hizo una solicitud extraña. Te pidió reunir ingredientes experimentales para el erudito de magia a quien protege. Son 10 Bolas de polvo, 10 Marcadores de hojas."
		},
		Summary = "10 Bolas de polvo, 10 Marcadores de hojas."
	},
	[7438] = {
		Title = "Protección secreta",
		Description = {
			"Shinaim no dijo nada sobre el erudito de magia a quien protege. Incluso pidió que me olvide lo que descubrí al respecto. ¿Alguien más lo sabe?"
		},
		Summary = "Busca información."
	},
	[7439] = {
		Title = "El erudito de magia a quien Shinaim protege",
		Description = {
