		},
		Summary = "Busca información."
	},
	[7440] = {
		Title = "El testigo de Minuel",
		Description = {
			"Minuel, el guardia de Eclage, dijo que Shinaim viaja con frecuencia al este, en dirección opuesta a su yai. Habla con Hisie."
