		},
		Summary = "Habla con Kardui."
	},
	[7443] = {
		Title = "¡Interfiere en la investigación!",
		Description = {
			"Una pequeña venganza. Kardui e Hisie quieren saber qué está investigando Avant y quieren interferir en eso. ¿Podría ser una pequeña venganza de los hermanos?"
		},
		Summary = "Interfiere en la investigación de Avant."
	},
	[7444] = {
		Title = "Lo que Avant investigaba",
		Description = {
			"Avant estaba investigando los métodos para extraer el poder mágico del Orbe. Dado que se trata de información peligrosa, el material de investigación debe regresar ahora mismo con Kardui."
		},
		Summary = "Entrega el material de investigación a Kardui."
	},
	[7445] = {
		Title = "El regreso de Avant",
		Description = {
			"Investigaste la motivación detrás de la investigación de Avant sobre el Orbe. El principal sospechoso es la protectora de Avant, la líder de gabinete. Ve con la líder de gabiente para revelar la verdad."
		},
		Summary = "Habla con la líder de gabiente."
	},
	[7446] = {
		Title = "Una conversación poco fructífera",
		Description = {
			"Hablé con Shinaim, la líder de gabinete, pero no logré nada. Afirma que también podría haber sido víctima del engaño de Avant. En realidad, la jefa de gabinete estaba molesta porque Kardui solo aumentó las defensas que rodeaban el Orbe."
		},
		Summary = "Regresa con Kardui."
	},
	[7447] = {
		Title = "El dilema en torno al Orbe",
		Description = {
			"Solo confirmaste la desconfianza hacia Kardui, en lugar de revelar más sobre la investigación de Avant. La lóider de gabinete esperaba que el criterio de Kardui no se haya debilitado y le pidió que lo demuestre."
		},
		Summary = "Regresa con Kardui."
	},
	[7448] = {
		Title = "Algo no está bien",
		Description = {
			"Tras hablar con Kardui e Hisie, se decidió que la líder de gabinete es, en efecto, la más sospechosa. ¿Cuál es el motivo de su oposición a las acciones de Kardui con respecto al Orbe?"
		},
		Summary = "Vigilancia de la líder de gabinete."
	},
	[7449] = {
		Title = "Tentación por el Orbe",
		Description = {
			"La líder de gabinete pidió ir a la sala de iluminación del Orbe para hablar al respecto. Decidí contárselo a Kardui después de pedirle más tiempo para pensarlo."
		},
		Summary = "Regresa con Kardui."
	},
	[7450] = {
		Title = "Sala de iluminación del Orbe",
		Description = {
			"No sabía por qué la líder de gabinete seguía intentando que fuera a la sala de iluminación del Orbe. De todos modos decidí ir porque quería saber la razón. Voy a seguirle el juego por ahora."
		},
		Summary = "Dale la mano a la líder de gabinete."
	},
	[7451] = {
		Title = "Traición",
		Description = {
			"Todo es tan confuso. El monstruo que luchaba en la sala de iluminación no era un subordinado del Rey de los Demonios. Me controlaban sin que yo lo supiera. ¡La líder de gabinete Shinaim traicionó a todos!"
		},
		Summary = "Regresa con Kardui."
	},
	[7452] = {
		Title = "¡Encuentren a la líder de gabinete!",
		Description = {
			"La líder de gabinete Shinaim, responsable de todos estos sucesos, no ha dejado rastro de su paradero. Según las fuentes de Hisie, en Bifrost se han percibido los remanentes de una fuerza mágica."
		},
		Summary = "Explora el norte de Bifrost."
	},
	[7453] = {
		Title = "El fin de la líder de gabinete",
		Description = {
			"El camino desde el norte hacia el sur en Bifrost. Antes se podía transitar, pero actualmente lo bloquea una enorme brecha en el sur. De camino a la grieta, encontraron el cadáver de la líder de gabinete."
		},
		Summary = "Regresa con Kardui."
	},
