			"Debes atravesar el laberinto y encontrar al líder de gremio."
		},
		Summary = "Encuentra al líder de gremio."
	},
	[8007] = {
		Title = "Aprobación del líder de gremio",
		Description = {
			"Trae el Collar del líder de gremio y ve con “Huey”, el experto Asesino."
		},
		Summary = "Entrega el Collar del líder de gremio."
	},
	[8008] = {
		Title = "Cambio de clase a Asesino",
		Description = {
			"¡Ahora eres un Asesino!"
		},
		Summary = "Cambio de clase a Asesino"
	},
	[8009] = {
		Title = "Solicitar cambio de clase a Sacerdote",
		Description = {
			"Acepta las tres pruebas del Sacerdocio para cambiar de clase."
		},
		Summary = "Solicitar cambio de clase a Sacerdote"
	},
	[8010] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"Debes hacer una peregrinación. Primero, visita a Rubalkabara, que está al noreste de las ruinas de Prontera. En segundo lugar, visita a la hermana Mathilda, que está cerca de Morroc, al suroeste de Prontera. Por último, visita al Padre Yosuke en un campo al noroeste de Prontera."
		},
		Summary = "Prueba 1: Peregrinación."
	},
	[8011] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"Ve al lugar donde se tendrá lugar el entrenamiento espiritual. Habla con Peter S. Alberto."
		},
		Summary = "Prueba 2: entrenamiento espiritual."
	},
	[8012] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"Empieza tu entrenamiento. ¡Acaba con todos los monstruos! ¡No les muestres piedad a las criaturas de la oscuridad!"
		},
		Summary = "Prueba 2: entrenamiento espiritual."
	},
	[8013] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"¡Completaste el entrenamiento espiritual! Visita a la monja Cecilia."
		},
		Summary = "Prueba para el cambio de clase a Sacerdote."
	},
	[8014] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"Haz la promesa de dedicarte a los dioses."
		},
		Summary = "Prueba 3: tu devoción a los dioses."
	},
	[8015] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"Completaste las 3 misiones al hacer el juramento del sacerdocio. Regresa con el obispo Paul."
		},
		Summary = "Solicitar cambio de clase a Sacerdote"
	},
	[8016] = {
		Title = "Cambio de clase a Sacerdote",
		Description = {
			"¡Ahora ya eres un Sacerdote!"
		},
		Summary = ""
	},
	[8017] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Zelmeto te pidió que lo ayudes a inspeccionar las máquinas de la fábrica, una por una, para saber cuál de ellas se debe reparar. Busca el panel de control 2 y avísale a Zelmeto."
		},
		Summary = ""
	},
	[8018] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Encontraste el panel de control 2, que está completamente averiado. Avísale a Zelmeto."
		},
		Summary = ""
	},
	[8019] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Zelmeto te pidió que inspecciones los reguladores automáticos de presión y que le informes sobre cualquier problema, independientemente de su insignificancia."
		},
		Summary = ""
	},
	[8020] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Encontraste los reguladores automáticos de presión y, después de una inspección más detenida, descubriste que están haciendo ruidos extraños y algunos de los tornillos están sueltos. Comunica tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8021] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Ahora, Zelmeto te pidió que inspecciones otro panel de control. Es parecido al primero, pero es más grande. Está en el centro de la fábrica. Encuéntralo y avísale a Zelmeto."
		},
		Summary = ""
	},
	[8022] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Parece que el panel de control principal no tiene ningún problema. Pero, después de golpear sobre su superficie, escuchas un desalentador sonido hueco. Parece que le faltan algunas piezas… Comunica tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8023] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Zelmeto te pidió que inspecciones un brazo mecánico que transporta objetos pequeños. Encuéntralo y reporta tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8024] = {
		Title = "Inspección de la fábrica",
		Description = {
			"La grúa se mueve de manera inestable y errática. El brazo mecánico tampoco parece lo suficientemente potente como para soportar las cargas que transporta… Comunica tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8025] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Ahora debes inspeccionar una tubería ubicada cerca de los calderos grandes de metal fundido e informar tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8026] = {
		Title = "Inspección de la fábrica",
		Description = {
			"La tubería que encontraste está inflada y desgastada por haber estado sobrecargada de presión por largos períodos. Es increíble que aún no haya explotado. Comunica tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8027] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Lo último que Zelmeto te pidió que inspecciones es una grúa más grande y potente. Encuéntrala y reporta tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8028] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Parece que esta última grúa tiene problemas similares a la grúa más pequeña. Sus movimientos son extraños, erráticos y débiles, y casi todos sus tornillos están oxidados. Comunica tus hallazgos a Zelmeto."
		},
		Summary = ""
	},
	[8029] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Zelmeto te dijo que necesita solicitar al superintendente un aumento en el presupuesto de reparación de la fábrica para asegurarse de que haya suficientes materiales para las reparaciones. Encuentra al superintendente."
		},
		Summary = ""
	},
	[8030] = {
		Title = "Inspección de la fábrica",
		Description = {
			"El superintendente se negó a aprobar el aumento en el presupuesto de reparación de la fábrica. Será mejor que le des a Zelmeto la mala noticia."
		},
		Summary = ""
	},
	[8031] = {
		Title = "Inspección de la fábrica",
		Description = {
			"Aun así, Zelmeto quiere hacer las reparaciones. Debido a eso, te pidió que le lleves ^FF000020 Tubos flexibles^000000, ^FF000010 Tornillos oxidados^000000, y ^FF000010 Placas de hierro usadas^000000 para hacer las reparaciones necesarias."
		},
		Summary = ""
	},
	[8032] = {
		Title = "El favor de Tarlock",
		Description = {
			"Tarlock dice que no le importaría contarte cómo funciona la Aeronave si le haces el favor de entregarle una carta a su hermano Ferlock."
		},
		Summary = "Entrega la carta de Tarlock a su hermano."
	},
	[8033] = {
		Title = "El favor de Ferlock.",
		Description = {
			"Ferlock te pidió que recuperes sus cosas que los monstruos que atacaron la Aeronave de Tarlock le robaron."
		},
		Summary = "Llévale 2 Testamentos de la oscuridad y 2 Frutos del cactus a Ferlock."
	},
	[8034] = {
		Title = "El favor de Ferlock.",
		Description = {
			"Ferlock te pidió que le lleves su respuesta a su hermano Tarlock."
		},
		Summary = "Entrega la carta de Ferlock a su hermano, Tarlock."
	},
	[8035] = {
		Title = "Cómo funciona la Aeronave",
		Description = {
			"Entregaste a Tarlock la carta de Ferlock. Es el momento perfecto para preguntarle cómo funciona la Aeronave."
		},
		Summary = "Continúa hablando con Tarlock."
	},
	[8036] = {
		Title = "El favor de Hallen.",
		Description = {
			"Hallen te pidió que le lleves una carta a Kaci, de parte de un tal Sr. Mawong, quien es algo así como su mentor."
		},
		Summary = "Entrégale la carta a Kaci."
	},
	[8037] = {
		Title = "El que juega a los dados",
		Description = {
			"Entregaste a Kaci la carta de Hallen. Probablemente deberías averiguar lo que ella sabe…"
		},
		Summary = ""
	},
	[8038] = {
		Title = "El que juega a los dados",
		Description = {
			"Resulta que Kaci es la prima de Hallen. Después de responder a tus preguntas, ha vuelto a organizar sus juegos. ¿Quién más podría conocer su pasado?"
		},
		Summary = ""
	},
	[8039] = {
		Title = "El secreto de las Aeronaves",
		Description = {
			"Hallen te contó que su proyecto es aprender más sobre cómo funcionan las aeronaves. Podría ser útil que le preguntes a alguien que sepa sobre Aeronaves y le cuentes a Hallen lo que descubriste."
		},
		Summary = ""
	},
	[8040] = {
		Title = "El secreto de las Aeronaves",
		Description = {
			"¿De verdad…? ¿Hablas en serio? Una imitación del Fragmento del corazón de Ymir. Bueno, ¿dónde he oído eso antes? A ver, déjame pensar… "
		},
		Summary = "Continúa hablando con Hallen."
	},
	[8041] = {
		Title = "El secreto de las Aeronaves",
		Description = {
			"¡Kaci me contó sobre un borracho que siempre menciona el Corazón de Ymir cuando juega a los dados para ganar manzanas!"
		},
		Summary = " "
	},
	[8042] = {
		Title = "El secreto de las Aeronaves",
		Description = {
			"Descubriste que el director del laboratorio de Einbroch tiene un Fragmento del corazón de Ymir. Vale la pena investigarlo…"
		},
		Summary = " "
	},
	[8043] = {
		Title = "El secreto de las Aeronaves",
		Description = {
			"Será mejor que te vayas. Los guardias patrullan este lugar frecuentemente, por lo que es casi seguro que te atrapen. Bueno, ven a verme más tarde a la Aeronave, ¿está bien? Ahora, date prisa."
		},
		Summary = "Tienes que ir a ver a Ferlock."
	},
	[8044] = {
		Title = "El prometido de Euslan",
		Description = {
			"… ¿De verdad vas a salir a buscar a Thierry? ¡Muchas gracias! No sabes lo mucho que tu amable gesto significa para mí. Thierry se fue de viaje en una de las Aeronaves para buscar las medicinas que, según los médicos, necesito para mi enfermedad."
		},
		Summary = " "
	},
	[8045] = {
		Title = "Los consejos de Kaci",
		Description = {
			"¡Ah, sí lo sé! Le pediré al capitán de la Aeronave que te ayude: tiene la lista de pasajeros con sus destinos."
		},
		Summary = "Revisa la lista de pasajeros del capitán."
	},
	[8046] = {
		Title = "La lista de pasajeros de Ferlock",
		Description = {
			"De acuerdo con esto, su último viaje en la Aeronave fue a Hugel. Es todo lo que dice aquí."
		},
		Summary = " "
	},
	[8047] = {
		Title = "El favor de Euslan",
		Description = {
			"Si es posible, visita a mi hermano Eukran en Hugel y pregúntale dónde podría estar mi Thierry."
		},
		Summary = " "
	},
	[8048] = {
		Title = "El testimonio de Eukran",
		Description = {
			"Verás, Thierry pasó por aquí hace un mes y me dijo que tenía que visitar el santuario de Odín. No lo sabía entonces, pero ahora creo que intenta ayudar a mi hermana."
		},
		Summary = " "
	},
	[8049] = {
		Title = "El favor de Thierry",
		Description = {
			"No puedo entrar en más detalles, pero hago este trabajo para encontrar una cura para la enfermedad de Euslan. La medicina moderna no la puede curar…"
		},
		Summary = " "
	},
	[8050] = {
		Title = "El peligro se cierne sobre Thierry",
		Description = {
			"Parece que Thierry se ha dado cuenta de lo que realmente estamos tramando. Creo que por eso está demorando su investigación. Será mejor que nos libremos de él antes de que sea demasiado tarde."
		},
		Summary = " "
	},
	[8051] = {
		Title = "La medicina de Euslan",
		Description = {
			"No importa lo que me pase a mí, pero debo salvar a Euslan. Solo necesito 5 Runas de la oscuridad para completar la medicina. Por favor, trotamundos, ayúdame a conseguirlas…"
		},
		Summary = "Consigue 5 Runas de la oscuridad."
	},
	[8052] = {
		Title = "El favor de Thierry",
		Description = {
			"Por favor, entiende que quiero verla lo antes posible, pero tengo que esperar hasta que esos agentes de Rekenber dejen de buscarme. Entrégale esa medicina a Euslan tan pronto como puedas: su vida depende de ello."
		},
		Summary = "Entrega la medicina a Euslan."
	},
	[8053] = {
		Title = "Encuentra a Postell",
		Description = {
			"¡Encuentra al hijo de Allen, Postell, y dile que traiga su medicina! Dirígete hacia el este y sal de la ciudad para que puedas encontrar a Postell."
		},
		Summary = "Postell."
	},
	[8054] = {
		Title = "El mensaje de Postell",
		Description = {
			"Postell te pidió que le hagas un favor y te asegures de que su padre no se meta en más problemas."
		},
		Summary = "Regresa con Allen."
	},
	[8055] = {
		Title = "Cuidando de Allen",
		Description = {
			"¡¿Qué pasa si me da otro ataque de úlcera antes de que Postell me traiga mis medicamentos?! ¡Quizá no sobreviva! Tro-trotamundos, ¿podrías acompañarme hasta que llegue mi hijo?"
		},
		Summary = "Cuida de Allen."
	},
	[8056] = {
		Title = "Algo a cambio",
		Description = {
			"“Por favor, revisa el botiquín y llévate lo que desees”. ~Allen"
		},
		Summary = "Mira dentro del botiquín."
	},
	[8057] = {
		Title = "Manainne de mal humor",
		Description = {
			"Habla con Manainne sobre el árbol de la tranquilidad."
		},
		Summary = ""
	},
	[8058] = {
		Title = "Conversación con El Schatt",
		Description = {
			"“Este árbol significa mucho para todos en esta ciudad y tenemos recuerdos especiales de este lugar. Pero ese tipo, El Schatt, quiere talarlo para su construir su tienda…”. -Manainne"
		},
		Summary = ""
	},
	[8059] = {
		Title = "Conversación con Perfitz",
		Description = {
			"El Schatt dice que su padre ha querido construir un mercado aquí durante mucho tiempo. Habla con su padre Perfitz y obtén su versión de la historia."
		},
		Summary = ""
	},
	[8060] = {
		Title = "El Schatt el testarudo",
		Description = {
			"“Si bien estoy satisfecho, tengo la sensación de que algo no está bien, como si tuviera muchas ganas de talar el árbol. Tal vez este anciano es demasiado sospechoso~”. -Perfitz"
		},
		Summary = ""
	},
	[8061] = {
		Title = "Historias del pasado",
		Description = {
			"El Schatt dice que hubo un tiempo en el que habría defendido al árbol con su vida, pero que ahora debería estar enterrado en el pasado. Tienes que encontrar a alguien que pueda saber sobre su pasado."
		},
		Summary = ""
	},
	[8062] = {
		Title = "Kanainne",
		Description = {
			"“¡Ahora El Schatt no es más que un desalmado a quien solo le importa el dinero…! Ha cambiado completamente. Si mi hermana pudiese verlo, estaría revolcándose en su tumba…”. -Manainne"
		},
		Summary = ""
	},
	[8063] = {
		Title = "El espíritu de Kanayne",
		Description = {
			"Yo… ¿puedo entrar al cuerpo de mi hermana? Sí, si ella coopera, tal vez… Tal vez funcione. Tengo que… tengo que hacer algo antes de que él… él… se lastime aún más…"
		},
		Summary = ""
	},
	[8064] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Por favor, lleva este pedido de Sopa de pastel de pescado a mi amiga Neha. Estoy muy feliz de que sea una clienta habitual…"
		},
		Summary = "Llévale el pedido a Neha."
	},
	[8065] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Llévale el siguiente pedido de Sopa de pastel de pescado a Maewan, otro de mis clientes habituales."
		},
		Summary = "Llévale el pedido a Maewan."
	},
	[8066] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Por favor, llévaselo a mi compañera Layoma. Pero… Ten cuidado. Tiene una manía con la puntualidad. Solo trata de no llegar tarde…"
		},
		Summary = "Entrega el pedido a Layoma."
	},
	[8067] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Rápido, llévale esta Sopa de pastel de pescado a Erjan. Um, pero ten cuidado, es muy quisquilloso…"
		},
		Summary = "Llévale el pedido a Erjan."
	},
	[8068] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"¡Llegas tarde! ¿No sabes que esta sopa no sabe bien si no está muy caliente? Pero… Te puedo perdonar… pero con una condición. Tráeme ^FF00001 Látigo^000000 para azotarte con él. Será mejor que te apures, si no, no te dejaré ir tan fácilmente."
		},
		Summary = "Lleva 1 Látigo a Neha."
	},
	[8069] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"¡Ay, llegaste tarde! Esto es tu culpa, lo sabes, ¿verdad? Puedo perdonarte si me ayudas con mi colección. Solo tráeme 1 Marcador en el recuerdo, ¿está bien?"
		},
		Summary = "Lleva 1 Marcador en el recuerdo a Maewan."
	},
	[8070] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"No puedo dejar que sigas haciendo entregas para Cellette a menos que me demuestres que puedo confiar en ti. Bueno, tráeme ^ff000011 Espora de hongo^000000 y me olvidaré de todo esto."
		},
		Summary = "Lleva 1 Espora de hongo a Layoma."
	},
	[8071] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Mm… Pero como el primogénito de la familia Franchesfeschu, no puedo comer esta sopa, a menos que esté debidamente preparada. ¡Ve! ¡Te ordeno que me traigas la ^ff0000Vajilla de porcelana^000000 común!"
		},
		Summary = "Llévale a Erjan 1 Vajilla de porcelana."
	},
	[8072] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Ooh, ¿te azoté accidentalmente dos veces? Je, je… Bueno, estoy satisfecha. Voy a contarle a Cellette que hiciste un buen trabajo… Espero que regreses para volver a traerme mi sopa~."
		},
		Summary = "Regresa con Cellette."
	},
	[8073] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"¡Genial, realmente me trajiste un Marcador en el recuerdo! Sí, esto es perfecto para mi colección~. Ah, y dame mi sopa. Gracias de nuevo por la entrega~."
		},
		Summary = "Regresa con Cellette."
	},
	[8074] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Está bien. Tal vez pueda contar contigo para trabajar para mi compañera Cellette un poco más. Ah, y por favor, dile que no venga a casa tan tarde todo el tiempo, ¿está bien?"
		},
		Summary = "Regresa con Cellette."
	},
	[8075] = {
		Title = "La Sopa de pastel de pescado de Cellette",
		Description = {
			"Puedes retirarte. Puedes retirarte y regresa con Cellette con mi más noble agradecimiento."
		},
		Summary = "Regresa con Cellette."
	},
	[8076] = {
		Title = "Klitzer y Calla",
		Description = {
			"Sé que estoy actuando como un completo idiota, pero daría cualquier cosa por ver a Calla… No escuches nada de lo que digo. Soy un pobre tonto enamorado de la persona equivocada. Tiene que ser así…"
		},
		Summary = " "
	},
	[8077] = {
		Title = "Klitzer y Calla",
		Description = {
			"Bueno, tal vez no lo pueda ver, pero ¿le darías mi violín a Klitzer por mí? Solía tocar esto para él todo el tiempo…"
		},
		Summary = "Lleva el violín de Calla a Klitzer."
	},
	[8078] = {
		Title = "Klitzer y Calla",
		Description = {
			"Es el violín de mi hija. Se lo regalé por sus quince años… ¡Te pasaste de la raya! ¡Guardias! ¡Acércate aquí!"
		},
		Summary = "Se llevaron el violín de Calla."
	},
	[8079] = {
		Title = "Klitzer y Calla",
		Description = {
			"Lo único que tienes que hacer es darle ^FF00001 Flor^000000. No tengo ningún zeny y no creo que sea bienvenido en la mansión Kapellthaine."
		},
		Summary = "Lleva 1 Flor a Calla."
	},
	[8080] = {
		Title = "Klitzer y Calla",
		Description = {
			"Si pasas por Einbroch, ¿le podrías agradecer a Klitzer de mi parte por la flor? Y-y… Y… Dile que lo extraño mucho."
		},
		Summary = "Entrega el mensaje de Calla a Klitzer."
	},
	[8081] = {
		Title = "Klitzer y Calla",
		Description = {
			"Ahora me siento mucho mejor. ¡Ah! Cuando tengas tiempo, ¿puedes hablar con mi madre? Siempre le gusta conocer a mis amistades."
		},
		Summary = "Conoce a la madre de Klitzer."
	},
	[8082] = {
		Title = "Klitzer y Calla",
		Description = {
			"No soporto que el odio mezquino entre nuestras dos ciudades impida a mi hijo ver a la mujer que ama… Encuentra a alguien que podría conocer la historia de Einbroch y Einbech."
		},
		Summary = " "
	},
	[8083] = {
		Title = "Klitzer y Calla",
		Description = {
			"¿Por qué no me traes ^990000Carbones^000000? No es imposible para alguien como tú, pero este tipo de tarea requerirá un poco de esfuerzo de tu parte."
		},
		Summary = "Lleva los Carbones a Satra."
	},
	[8084] = {
		Title = "Klitzer y Calla",
		Description = {
			"Bueno, trataré de encontrarles alguna utilidad. Creo que el regalo que te he pedido no es muy práctico. ¿Cómo se suele usar el carbón? ¡Ah, tengo una idea novedosa! Parece que llevarle Carbones hará que Satra hable."
		},
		Summary = "Lleva más Carbones a Satra."
	},
	[8085] = {
		Title = "Klitzer y Calla",
		Description = {
			"Bueno, la próxima vez que veas a Klitzer dile que me visite pronto. Ah, y recuérdale que se vista adecuadamente para esta ocasión especial. ¡Jo, jo, jo, jo, jo!"
		},
		Summary = "Lleva el mensaje a Klitzer."
	},
	[8086] = {
		Title = "Klitzer y Calla",
		Description = {
			"¿Cómo…?  ¿Qué dijiste? ¿Me acabas de decir que la madre de Calla me ha invitado a tomar el té con ella? ¡Por todos los dioses…!"
		},
		Summary = " "
	},
	[8087] = {
		Title = "Klitzer y Calla",
		Description = {
			"Gracias por ayudar a mi hijo Klitzer. Lamentablemente, el tontín no tiene ni idea cuando se trata de ciertas cosas como elegir la ropa. Un hombre debe llevar ropa bonita, como un traje formal o un esmoquin, para las reuniones importantes y ocasiones especiales. "
		},
		Summary = "Consíguele a Klitzer un bonito atuendo."
	},
	[8088] = {
		Title = "Klitzer y Calla",
		Description = {
			"Realmente me has abierto los ojos. A partir de ahora, haré todo lo posible para ganarme la aprobación de los padres de Calla y ser digno de su amor."
		},
		Summary = " "
	},
	[8089] = {
		Title = "La Gema robada",
		Description = {
			"No tengo ninguna prueba, pero sospecho que la robó Phobe, un sirviente que desapareció casi al mismo tiempo que la gema desapareció. Podrías interrogar a los otros sirvientes sobre su paradero."
		},
		Summary = "Obtén información sobre el paradero de Phobe."
	},
	[8090] = {
		Title = "El Sr. Manson",
		Description = {
			"En verdad, no sé mucho ya que tengo poco tiempo trabajando aquí. ¿Por qué no le preguntas a los empleados más antiguos? Podrías preguntarle al Sr. Manson dentro de la mansión."
		},
		Summary = "Encuentra al Sr. Manson."
	},
	[8091] = {
		Title = "Jenny, la jardinera",
		Description = {
			"Ah, nuestra jardinera Jenny fue la que me lo presentó. Lleva mucho tiempo trabajando para sir Zhed y le encantan los niños. Si quieres saber más sobre ese niño, deberías hablar con Jenny."
		},
		Summary = "Encuentra a Jenny."
	},
	[8092] = {
		Title = "La búsqueda en el mercado",
		Description = {
			"Muy bien, supongo que puedo ir al mercado y preguntar por ahí."
		},
		Summary = "Ve al mercado."
	},
	[8093] = {
		Title = "Mensaje misterioso",
		Description = {
			"Sí, anoche un tipo me pidió que, si alguien estuviese buscando a un tal Phobe, le diera un mensaje. Básicamente, quiere que vayas a la “Cueva de hielo”. A ver, su nombre era… ¿Nogan? ¿Rogan? Algo así."
		},
		Summary = "Ve a la Cueva de hielo."
	},
	[8094] = {
		Title = "¿La traición?",
		Description = {
			"Las instrucciones de Vincent eran matar a cualquiera que preguntara por Rogan, un nombre que él inventó. Parece que nos tendió una trampa, colega. Lo siento, no lo habría hecho si lo hubiera sabido."
		},
		Summary = "Regresa con Vincent."
	},
	[8095] = {
		Title = "Encuentra a Phobe",
		Description = {
			"No te meterás en problemas si puedo encontrar la joya y a Phobe antes de que regrese sir Zhed, así que intentaré encontrarlos lo antes posible. Phobe es solo un niño, así que probablemente se está escondiendo en algún lugar de la ciudad…"
		},
		Summary = "Intenta encontrar a Phobe."
	},
	[8096] = {
		Title = "La gema robada fue recuperada",
		Description = {
			"Para que lo sepas, ¡no pienso regresar a mi casa! Bueno, al menos, no en este momento. Pero dile a mi madre que estoy bien y que no se preocupe."
		},
		Summary = "Regresa con Vincent."
	},
	[8097] = {
		Title = "Jenny recibe la noticia",
		Description = {
			"Mientras devuelvo esta joya, ¿podrías decirle a mi esposa Jenny que nuestro hijo está bien? Ha estado muy preocupada por él, así que…"
		},
		Summary = "Jenny."
	},
	[8098] = {
		Title = "Guardar el secreto",
		Description = {
			"¡Gracias por toda tu ayuda, trotamundos~!"
		},
		Summary = "Regresa con Vincent."
	},
	[8099] = {
		Title = "La recomendación de Vincent",
		Description = {
			"Esta es una carta de recomendación que te he escrito. Por favor, entrégasela a sir Zhed lo antes posible. Adiós y gracias por todo."
		},
		Summary = "Ve a ver a sir Zhed."
	},
	[8100] = {
		Title = "Recomendación del Sumo sacerdote Zhed",
		Description = {
			"Mientras termino de escribir esta recomendación, déjame decirte cómo llegar a la oficina de la papisa, a donde debes ir cuando reúnas 40 Corazones glaciales."
		},
		Summary = "Reúne 40 Corazones glaciales y ve a ver a la papisa."
	},
	[8101] = {
		Title = "Recomendación del Sumo sacerdote Zhed",
		Description = {
			"Realmente quiero darte las gracias por venir a hablar conmigo. La pasé muy bien aprendiendo. Ahora tengo que ir a oficiar las ceremonias, así que… Adiós por ahora."
		},
		Summary = "Regresa con sir Zhed."
	},
	[8102] = {
		Title = "Recomendación del Sumo sacerdote Zhed",
		Description = {
			"Lo siento, pero aún no terminamos de hablar. Mientras tanto, puedes esperarme y descansar en la sala de al lado."
		},
		Summary = " "
	},
	[8103] = {
		Title = "Recomendación del Sumo sacerdote Zhed",
		Description = {
			"Quiero ofrecerte un consejo. No te acerques mucho al sumo sacerdote Zhed. Si lo haces, podrías terminar metiéndote en problemas…"
		},
		Summary = "Regresa con sir Zhed."
	},
	[8104] = {
		Title = "Recomendación del Sumo sacerdote Zhed",
		Description = {
			"Ah, pero antes de que te vayas, permíteme advertirte que no ^FF0000te acerques a la tierra sagrada^000000. Repito, no vayas a la tierra sagrada."
		},
		Summary = " "
	},
	[8105] = {
		Title = "Recomendación del Sumo sacerdote Zhed",
		Description = {
			"Le advertí a Bekento que podría causarte problemas, pero parece que tú se los causaste a él. Tienes que entender que la mayoría de los intrusos reciben un gran castigo, pero debido a mi amistad con Bekento, te lo voy a dejar pasar. Recuerda eso…"
		},
		Summary = "Regresa con sir Zhed."
	},
	[8106] = {
		Title = "La hija del Sr. Shendar",
		Description = {
			"El Sr. Shendar dice que su hija ha estado saliendo con alguien. Fue a un pueblo por ese chico y, desde entonces, no se sabe nada de ella. Encuentra a alguien que pueda saber lo que le pudo haber pasado."
		},
		Summary = ""
	},
	[8107] = {
		Title = "El testimonio de Lachellen",
		Description = {
			"¡Ay, estoy tan celosa de Bruspetti! Últimamente, pasa demasiado tiempo con su nuevo novio… Pero sigue negándose a decirme cómo se llama. Veamos… ¿Creció en Lighthalzen? Es todo lo que sabe."
		},
		Summary = "Encuentra a un extranjero en la ciudad."
	},
	[8108] = {
		Title = "Un extranjero, Katinshuell",
		Description = {
			"Katinshuell te dijo que la relación entre él y su novia terminó. Tal vez esté hablando sobre la hija del Sr. Shendar. Deberías preguntárselo."
		},
		Summary = "Habla con el Sr. Shendar."
	},
	[8109] = {
		Title = "El aroma de Bruspetti",
		Description = {
			"El Sr. Shendar dice que su hija Bruspetti tiene un aroma agradable y distintivo, igual que su madre. Tienes que buscar a alguien con un aroma agradable y distintivo en Lighthalzen."
		},
		Summary = "Busca el aroma de Bruspetti en Lighthalzen."
	},
	[8110] = {
		Title = "El aroma de Bruspetti",
		Description = {
			"Ese… Ese olor… ¡Huele tan bien! Como pétalos de rosa cabalgando sobre una suave brisa… Espera, ¿podría ser este el aroma que el padre de Bruspetti mencionó?"
		},
		Summary = "Regresa a Rachel y anda a ver a Lachellen."
	},
	[8111] = {
		Title = "El testimonio de Lachellen",
		Description = {
			"Si está en Lighthalzen, probablemente haya ido para saber más sobre su novio. Mmm; si revisas el lugar donde ella y su novio solían tener citas, quizás encuentres algo."
		},
		Summary = "Encuentra el Manantial de Freya."
	},
	[8112] = {
		Title = "El Manantial de Freya",
		Description = {
			"Lo siento, no quería asustarte, pero el suelo que pisas es muy resbaladizo."
		},
		Summary = "Regresa con el Sr. Shendar."
	},
	[8113] = {
		Title = "El diario de Bruspetti",
		Description = {
			"Como padre cariñoso, no puedo permitirme invadir la intimidad de mi preciosa hija. Aunque haya tenido el descuido de dejar su diario sobre el cajón."
		},
		Summary = "Busca el diario encima del cajón."
	},
	[8114] = {
		Title = "El diario de Bruspetti",
		Description = {
			"¡Este debe ser el diario de Bruspetti! Pero… si lo lees, te estarías pasando de la raya. Tienes que preguntarle a Katinshuell si sabe por qué Bruspetti está en Lighthalzen."
		},
		Summary = "Encuentra a Katinshuell."
	},
	[8115] = {
		Title = "Katinshuell, el desconfiado",
		Description = {
			"Katinshuell insiste en que lo dejen en paz. Tal vez otra persona sepa algo más sobre el interés de Bruspetti en el Manantial de Freya y Lighthalzen."
		},
		Summary = "Ve a buscar a Lachellen."
	},
	[8116] = {
		Title = "El testimonio de Lachellen",
		Description = {
			"¿El Manantial de Freya? ¡Oh, ese lugar me gusta! Hablando de eso, conozco a alguien que se llama Katinshuell que iba ahí muy seguido. Por lo general, los hombres no van solos…"
		},
		Summary = "Anda al Manantial de Freya."
	},
	[8117] = {
		Title = "El Manantial de Freya",
		Description = {
			"¿Ves el borde del manantial? El mismo joven va seguido a ese lugar y mira fijamente al agua, empapado de tristeza. Alguien tan joven no debería sentirse así."
		},
		Summary = "Regresa con el Sr. Shendar."
	},
	[8118] = {
		Title = "Conversación con el Sr. Shendar",
		Description = {
			"Espera, espera… ¿Así que alguien ha estado merodeando por aquí? Qué raro. Espera, ese tipo, el que podría ser el novio de Bruspetti…"
		},
		Summary = "Recupera el diario de Bruspetti."
	},
	[8119] = {
		Title = "El diario de Bruspetti",
		Description = {
			"Ya tienes permiso para llevarte el diario y así poder averiguar si Bruspetti y Katinshuell están relacionados… Lleva el diario a Katinshuell."
		},
		Summary = "Katinshuell."
	},
	[8120] = {
		Title = "Conversación con Katinshuell",
		Description = {
			"¡Dime la verdad! En realidad, ¿sabes qué? ¿Por qué no la descubrimos al mismo tiempo? ¿Qué te parece?"
		},
		Summary = "Sigue hablando con Katinshuell."
	},
	[8121] = {
		Title = "Conversación con Katinshuell",
		Description = {
			"Todavía se resiste a mí… ¿Cómo puedo hacer que revele la verdad? Quizás haya algo que pueda usar para hacerlo confesar…"
		},
		Summary = "Sigue hablando con Katinshuell."
	},
	[8122] = {
		Title = "El lugar de descanso de Bruspetti",
		Description = {
			"… Por favor, déjame en paz. Perdí a la mujer que amo por una estupidez que hice en el pasado. Si quieres delatarme, hazlo…"
		},
		Summary = "Anda al Manantial de Freya."
	},
	[8123] = {
		Title = "El plato de Ayothaya mundialmente famoso, la sopa de camarones",
		Description = {
			"Cualquiera puede preparar una sopa de camarones, pero te recomiendo que vayas a visitar a ^3131FFla picante Srta. Mali^000000. Es la mejor cocinera. ¿Por qué no le pides que cocine para ti?"
		},
		Summary = " "
	},
	[8124] = {
		Title = "El plato de Ayothaya mundialmente famoso, la sopa de camarones",
		Description = {
			"Puedes comprar los Camarones más frescos de alguien llamado “^3131FFThongpool^000000”. Consigue 20 Camarones para preparar la sopa de camarones."
		},
		Summary = "Lleva 20 Camarones a la picante Srta. Mali."
	},
	[8125] = {
		Title = "El plato de Ayothaya mundialmente famoso, la sopa de camarones",
		Description = {
			"La picante Srta. Mali encontró cerca un árbol limonero muy bonito, pero esos limones no estaban a la venta.  Debes conseguir algunos limones del dueño del limonero."
		},
		Summary = "Lleva 10 Limones a la picante Srta. Mali."
	},
	[8126] = {
		Title = "El plato de Ayothaya mundialmente famoso, la sopa de camarones",
		Description = {
			"Ahora debes obtener ^CE0000Chile^000000 y otros ingredientes del mercado. Pregúntale al comerciante del mercado y te dirá qué ingredientes conseguir."
		},
		Summary = "Lleva 30 Chiles, junto con otros ingredientes, a la picante Srta. Mali."
	},
	[8127] = {
		Title = "La excursión de Momotaro",
		Description = {
			"El jefe dijo que Dokebi ganó 20 millones de zeny hackeando cuentas ajenas… Como en el pueblo pasamos el tiempo sentados y charlando, no podemos matar a Dokebi ya que nuestro nivel es bajo, así que… ¿lo puedes hacer por nosotros?"
		},
		Summary = "Derrota a Dokebi."
	},
	[8128] = {
		Title = "La excursión de Momotaro",
		Description = {
			"La historia de Momotaro ya terminó. Puedes obtener tu premio cuando hables con la editora que viste primero."
		},
		Summary = " "
	},
	[8129] = {
		Title = "La excursión de Momotaro",
		Description = {
			"Se supone que en este momento tengo que hacer que regreses… ¡PERO! Te daré una oportunidad. Si fracasas, ^3163FFno podrás aceptar este desafío.^000000Además, esta misión será bastante difícil."
		},
		Summary = " ?"
	},
	[8130] = {
		Title = "La excursión de Momotaro",
		Description = {
			"Realmente me sorprendes. ¡Tienes talento! Déjame mostrarte la salida. La pasé muy bien… No te olvides de tu premio."
		},
		Summary = " "
	},
	[8131] = {
		Title = "La madre del lord en Amatsu",
		Description = {
			"La madre de nuestro lord descansa aquí. Lleva meses enferma. Por eso se queda aquí."
		},
		Summary = " "
	},
	[8132] = {
		Title = "La madre del lord en Amatsu",
		Description = {
			"Tú, que vienes de Rune-Midgarts, quizá podrías curar la enfermedad de mi madre. Te recompensaré bien si logras hacerlo… Mi madre vive en una casa de las afueras del palacio. Ven a verme cuando termines el tratamiento."
		},
		Summary = "Encuentra el tratamiento para curar a la madre del lord."
	},
	[8133] = {
		Title = "La canción del zorro",
		Description = {
			"Sacerdote, sacerdote~. ¡Un zorro me está siguiendo! ¡No se va, a pesar de que grito y grito! El sacerdote del santuario del norte debería ayudarme~. Gñiii, gñiii, gñiiiii~~."
		},
		Summary = " "
	},
	[8134] = {
		Title = "El niño en el santuario del norte",
		Description = {
			"Un espíritu más fuerte expulsará al zorro de un humano. ¡Vamos, grita y muéstrame tu espíritu!"
		},
		Summary = " "
	},
	[8135] = {
		Title = "La expulsión del zorro",
		Description = {
			"^FF6060¡Aaauuu! ¡Aaauuu! ¡Aaauuu! ¡Humano! ¡Cómo te atreves a expulsarme de este cuerpo! ¡Te maldigo! ¡¡Infeliz!! Maldeciré a la familia Ishida, ¡y será mejor que tengas cuidado, humano!^000000"
		},
		Summary = "Habla con el Señor del Palacio"
	},
	[8136] = {
		Title = "La advertencia del Lobo gris",
		Description = {
			"Conociste a un Lobo gris que te advierte sobre alguien llamado Koshei, el Inmortal, y te dice que debes abandonar este lugar. Pero ¿quién es exactamente este Koshei? Quizás el Lobo gris regrese y se explique más…"
		},
		Summary = ""
	},
	[8137] = {
		Title = "Búsqueda del cerrajero",
		Description = {
			"Al parecer, Koshei es un ser malvado inmortal que fue confinado por una chica llamada María. Es necesario liberar a María de su prisión de piedra con la ayuda del cerrajero, para que fabrique la ^0000ffLlave dorada^000000."
		},
		Summary = ""
	},
	[8138] = {
		Title = "La petición del herrero",
		Description = {
			"El Herrero te pidió que le lleves 25 unidades de Acero. Te prometió que te explicará cómo fabricar la “Llave dorada” cuando le lleves el Acero."
		},
		Summary = ""
	},
	[8139] = {
		Title = "La Llave dorada",
		Description = {
			"El Herrero dice que necesitas ^0000ff22 Rubíes malditos, 3 unidades de Oro, 1 Anillo rojo, 2 unidades del Pelo de Lusalka y 10 Hilos dorados^000000 para fabricar la Llave dorada. Habla con el Herrero para que te diga cómo conseguir los materiales. Y no te olvides de ponerte tus resistentes Botas de acero."
		},
		Summary = ""
	},
	[8140] = {
		Title = "El Anillo rojo",
		Description = {
			"El abuelo Vassili dice que tenía un Anillo rojo, pero que se lo dio a su hija Mashenka, quien desgraciadamente falleció. Pero tiene otra hija, Ryubaba, que podría saber algo el Anillo rojo."
		},
		Summary = "Ryubaba."
	},
	[8141] = {
		Title = "El Anillo rojo de Mashenka",
		Description = {
			"Ryubaba te dijo que su hermana Mashenka probablemente llevaba el Anillo rojo cuando desapareció en el pantano."
		},
		Summary = ""
	},
	[8142] = {
		Title = "La búsqueda en el pantano",
		Description = {
			"Hablaste con una pastora cerca del pantano y te pidió que le llevaras ^0000ff2525 Ramas puntiagudas^000000 mientras buscas a Mashenka y su Anillo rojo."
		},
		Summary = ""
	},
	[8143] = {
		Title = "La voz de la flauta",
		Description = {
			"La pastora te hizo una Flauta de madera con las ramas que le llevaste. Una voz extraña canta una canción triste cuando se toca. Tienes que preguntarle a Ryubaba sobre la voz que canta con la flauta."
		},
		Summary = ""
	},
	[8144] = {
		Title = "La confesión de Ryubaba",
		Description = {
			"No podrás estar en paz si no le dices a Vasilli la verdad sobre lo que pasó entre sus dos hijas. Dile lo que Ryubaba te confesó sobre Mashenka y trae la Flauta de madera como evidencia."
		},
		Summary = ""
	},
	[8145] = {
		Title = "El ruego de una madre preocupada",
		Description = {
			"Conociste a una madre preocupada que te contó una historia sobre la ninfa del agua Lusalka, que podría ser su hija. Continúa tu conversación con la madre preocupada."
		},
		Summary = ""
	},
	[8146] = {
		Title = "En busca de Lusalka",
		Description = {
			"Para encontrar a la ninfa del agua, Lusalka, debes encontrar un zona de agua entre las 17:00 y las 6:00 (PST), y llevar Agua bendita para protegerte de su peligrosa mirada."
		},
		Summary = ""
	},
	[8147] = {
		Title = "El amado de Lusalka",
		Description = {
			"Lusalka te pidió que encuentres a su amado Igor en la capital del reino de Rune-Midgarts, que le entregues sus aros de oro y le digas que deje de sufrir."
		},
		Summary = ""
	},
	[8148] = {
		Title = "El amado de Lusalka",
		Description = {
			"Encontraste a un vagabundo de Moscovia que viajó a Prontera con Igor, pero ya se separaron. Dijo que Igor se dirigía a un desierto… El desierto más cercano que conoces es…"
		},
		Summary = ""
	},
	[8149] = {
		Title = "En búsqueda de Igor",
		Description = {
			"Un aldeano de Morroc dice que pudo haber visto a Igor y que entró a la Pirámide. Puede que por fin lo hayas ubicado para entregarle los Aros de oro de Lusalka."
		},
		Summary = ""
	},
	[8150] = {
		Title = "El mensaje de Igor",
		Description = {
			"Igor te pidió que fueras a ver a Lusalka y le digas que todavía la ama. Quizás ahora ella acepte regalarte las hebras de su cabello para que hagas la Llave dorada. Recuerda llevar “Agua bendita” cuando hables con Lusalka para protegerte de su mirada."
		},
		Summary = ""
	},
	[8151] = {
		Title = "La cueva de Marozka",
		Description = {
			"Marozka dice que necesita probar tu valía para luchar contra Koshei. Llévale 100 Galletas bien horneadas del horno de piedra y 100 Manzanas del manzano de su cueva."
		},
		Summary = ""
	},
	[8152] = {
		Title = "El Hilo dorado",
		Description = {
			"Le llevaste las Galletas y las Manzanas a Marozka. Dice que le llevará un rato hacer el Hilo dorado. Regresa en una hora y seguro que lo tendrá listo."
		},
		Summary = ""
	},
	[8153] = {
		Title = "La prueba de la mente y la sabiduría",
		Description = {
			"Debes superar todas las pruebas de Marozka y él te dará el Hilo dorado que acaba de hacer."
		},
		Summary = ""
	},
	[8154] = {
		Title = "El cerrajero",
		Description = {
			"El cerrajero está en una cabaña en lo profundo del bosque. Ten presente las palabras del cerrajero y no te olvides del Hechizo protector del Herrero, la “^0000ffProtección de escudo mágico^000000”."
		},
