	[8181] = {
		Title = "Destello de visión",
		Description = {
			"Esta habilidad parece fácil, pero es muy difícil de aprender. Los Caballeros son expertos con las habilidades que hacen retroceder a los enemigos, así que ve a buscar a uno para que te explique la teoría del retroceso en Prontera. Revisa la dirección de las 11:00 en tu minimapa."
		},
		Summary = " "
	},
	[8182] = {
		Title = "La teoría del retroceso",
		Description = {
			"Bueno, te expliqué cómo hacer retroceder lo mejor que pude. Concéntrate y practica la teoría por tu cuenta para que puedas lograrlo."
		},
		Summary = "Regresa con Miau."
	},
	[8183] = {
		Title = "Destello de visión",
		Description = {
			"No soy un alma caritativa, así que ¡espero recibir una compensación por todos mis conocimientos y esfuerzos! ¡Ve y tráeme ^ff00001010 unidades de Azul cristal, 10 de Vida verde, 10 de Sangre roja y 10 de Viento de verdor^000000!"
		},
		Summary = "Llévale los materiales a Miau."
	},
	[8184] = {
		Title = "El Convertidor elemental",
		Description = {
			"Por favor, trae los materiales necesarios para poder construir un Convertidor elemental básico. Necesitas ^ff000077 Cuernos, 12 Caparazones arcoíris, 10 Caparazones de caracol, 4 Pergaminos en blanco, 10 Colas de escorpión^000000."
		},
		Summary = "Vuelve con Mishuna y dale los materiales."
	},
	[8185] = {
		Title = "Cambio elemental",
		Description = {
			"Ahora ya puedes aprender la otra habilidad, el ^ff0000Cambio Elemental^000000. Necesito preparar algunas cosas para esta lección, así que nos veremos y hablaremos de esto más tarde, ¿está bien?"
		},
		Summary = " "
	},
	[8186] = {
		Title = "Cambio elemental de Fuego",
		Description = {
			"Tráeme ^ff000020 20 unidades de Sangre roja, 1 Solución de Payon y 1 Solución de Morroc^000000. Solo así podrás aprender ^ff0000Cambio elemental de fuego^000000."
		},
		Summary = "Vuelve con Mishuna y dale los materiales."
	},
	[8187] = {
		Title = "Cambio elemental de Tierra",
		Description = {
			"Tráeme ^ff00002020 unidades de Vida verde, 1 Solución de Payon y 1 Solución de Morroc^000000. Solo así podrás aprender ^ff0000Cambio elemental de tierra^000000."
		},
		Summary = "Vuelve con Mishuna y dale los materiales."
	},
	[8188] = {
		Title = "Cambio elemental de Viento",
		Description = {
			"Tráeme ^ff00002020 unidades de de Viento de verdor, 1 Solución de Payon y 1 Solución de Morroc^000000. Solo así podrás aprender ^ff0000Cambio elemental de viento^000000."
		},
		Summary = "Vuelve con Mishuna y dale los materiales."
	},
	[8189] = {
		Title = "Cambio elemental de Agua",
		Description = {
			"Tráeme ^ff00002020 unidades de Azul cristal, 1 Solución de Payon y 1 Solución de Morroc^000000. Solo así podrás aprender ^ff0000Cambio elemental de agua."
		},
		Summary = "Vuelve con Mishuna y dale los materiales."
	},
	[8190] = {
		Title = "Guiño encantador",
		Description = {
			"¡Tienes que traerme ^FF00001 Espejo de cristal^0000000! Esta herramienta es imprescindible para la lección, ¡así que búscala y tráemela rápido!"
		},
		Summary = "Lleva 1 Espejo de cristal a Canell."
	},
	[8191] = {
		Title = "La consejera encantadora",
		Description = {
			"Ahora que ya tienes la actitud adecuada sobre la belleza, es hora de que aprendas una técnica avanzada de seducción. Ve a buscar a mi hermana en la iglesia de Prontera. Estará dispuesta a enseñarte."
		},
		Summary = " "
	},
	[8192] = {
		Title = "La consejera egoísta",
		Description = {
			"Quiero tomar una bebida de verdad, ^FF0000Alcohol^000000ic… ¡hip!. Ah. ¡Y necesito algunos refrigerios para mantener toda mi energía durante la lección! ^FF00001 Manzana, 3 Bananas y 5 Galletas bien horneadas^000000 sobre una fina ^FF0000Vajilla de porcelana^000000."
		},
		Summary = "Vuelve con Aelle con la Bebida alcohólica y el bocadillo."
	},
	[8193] = {
		Title = "La consejera egoísta",
		Description = {
			"Ahora, el gesto más fácil, sutil y atractivo de todos los tiempos es el ^FF0000guiño^000000. Me ha salvado en tiempos de crisis; dominarlo mejorará tus encantos."
		},
		Summary = " "
	},
	[8194] = {
		Title = "La consejera borracha",
		Description = {
			"¡V-vete! ¡Habla con Canell, mi hermana…! Zzz, zzz, zzz…"
		},
		Summary = " "
	},
	[8195] = {
		Title = "Canell, la amable.",
		Description = {
			"Ahora, una verdadera bailarina debe ser capaz de descubrir por sí misma el secreto de cómo guiñar el ojo. Pero como soy una mujer tan amable, me dignaré a explicártelo. Jo, jo~."
		},
		Summary = " "
	},
	[8196] = {
		Title = "El conflicto de la Unión tripartita",
		Description = {
			"Esos investigadores se quejan mucho hoy en día. Están sumamente estresados y creo que alguien debería escuchar sus problemas. Esas personas que trabajan con documentos suelen discutir mucho entre ellos. Tal vez podrías hablar con ellos para empezar."
		},
		Summary = " "
	},
	[8197] = {
		Title = "La entrega de documentos",
		Description = {
			"Está bien, ahora, por favor entrega el archivo a Hue y Hansenne. Hue está a cargo de los documentos de Schwartzvalt y Hansenne está a cargo de los de Arunafeltz. Anda a ver a Hue en la oficina de Schwartzvalt, de lo contrario, se va a quejar."
		},
		Summary = "Entrega los documentos a Hue y Hansenne y regresa con Ryosen."
	},
	[8198] = {
		Title = "Informa al oficial del Grupo de Investigación Unida",
		Description = {
			"Bueno, ya no hay vuelta atrás. Necesito ir a esa reunión, me guste o no. ¿Podrías enviar esto al oficial del Grupo de investigación unida? Mientras tanto, tengo que prepararme para la reunión."
		},
		Summary = "Entrega los documentos al oficial del Grupo de investigación unida."
	},
	[8199] = {
		Title = "El favor del oficial del Grupo de Investigación Unida",
		Description = {
			"¡Por favor, tienes que participar en la reunión y mediar si algo sale mal! Primero, debes reunirte con esas 3 personas y ayudarlas a preparar la reunión. Espero que no estén preparando armas ni nada por el estilo."
		},
		Summary = " "
	},
	[8200] = {
		Title = "Las solicitudes de los documentos de Ryosen",
		Description = {
			"Hice una solicitud a la oficina de Arunafeltz, pero todavía no recibo nada. ¿Podrías conseguirlo de Hansenne? Lo necesito para la reunión, pero nunca me lo envía. Se debe haber olvidado… ¡otra vez!"
		},
		Summary = " "
	},
	[8201] = {
		Title = "El documento extraviado",
		Description = {
			"Lo perdí. Creo que se me cayó al río o algo así cuando jugaba a buscar tesoros en un puente. Pero esos gatitos del suroeste pueden enseñarnos a pescar, ¿lo sabías? ¡Quizá podemos pescar el documento en el río!"
		},
		Summary = "Regresa con Hansenne con el documento que pescaste."
	},
	[8202] = {
		Title = "La restauración de los documentos",
		Description = {
			"La gente de Schwartzvalt tiene talento para restaurar cosas como esta… ¿Por qué no le pides a Hue que restaure esto? Va a gritar tan fuerte que las ventanas se van a romper."
		},
		Summary = " "
	},
	[8203] = {
		Title = "La restauración de los documentos",
		Description = {
			"Está completamente empapado. Primero tengo que secar esto y planchar las arrugas. Y, después, podré restaurar los textos. Necesito algunos materiales. Tienes que ayudarme con esto. Necesito ^0000ff1 Abanico plegable de gato fantasma, 1 Sartén vieja, 1 Piedra ardiente y 1 unidad de Tinta de calamar^000000”."
		},
		Summary = "Trae 1 Abanico plegable de gato fantasma, 1 Sartén vieja, 1 Piedra ardiente y 1 unidad de Tinta de calamar."
	},
	[8204] = {
		Title = "Ryosen",
		Description = {
			"La encuadernación estaba demasiado suelta, así que reorganicé el archivo y volví a encuadernarlo. Por favor, entrega este archivo antes de que sea demasiado tarde."
		},
		Summary = " "
	},
	[8205] = {
		Title = "Informa al oficial del Grupo de Investigación Unida",
		Description = {
			"¿Podrías pedirle al oficial que me espere un poco? Tengo que buscar otro documento para la reunión."
		},
		Summary = " "
	},
	[8206] = {
		Title = "La reunión de los investigadores",
		Description = {
			"Participa en la reunión."
		},
		Summary = " "
	},
	[8207] = {
		Title = "Hansenne no es culpable",
		Description = {
			"Lo único que quería era que se unieran más, que fortalecieran su amistad… Pero siempre surgen problemas. ¿Se te ocurre algo para hacer que se lleven mejor?"
		},
		Summary = " "
	},
	[8208] = {
		Title = "El favor de Hansenne",
		Description = {
			"Pronto estará bien. Llegará a pensar que en realidad no fue para tanto. Pero el hecho es que… la relación entre Ryosen y Hue no se ve nada bien. ¿Por qué no los ayudas a que se lleven bien?"
		},
		Summary = " "
	},
	[8209] = {
		Title = "El informe de Hue",
		Description = {
			"Este es el informe del reino de Rune-Midgarts que tenía conmigo cuando todo salió mal en la sala de reuniones. ¿Podrías dárselo a Ryosen?"
		},
		Summary = " "
	},
	[8210] = {
		Title = "Informa al oficial del Grupo de Investigación Unida",
		Description = {
			"Está bien. Debería organizar otra reunión cuanto antes. ¿Podrías ir a ver al oficial en mi lugar y concertar una reunión?"
		},
		Summary = " "
	},
	[8211] = {
		Title = "La lección de Shurank",
		Description = {
			"¿Has estado aprendiendo el arte de usar Aporreo? ¡Tengo la certeza de que la habilidad Aporreo es la esencia del arte de la espada!"
		},
		Summary = "Domina la habilidad Aporreo y regresa con Shurank."
	},
	[8212] = {
		Title = "La lección de Shurank",
		Description = {
			"Veo que sabes un poco sobre la habilidad Aporreo. Pero aun así, no es suficiente."
		},
		Summary = "Domina la habilidad Aporreo y regresa con Shurank."
	},
	[8213] = {
		Title = "La lección de Shurank",
		Description = {
			"Veo que has adquirido cierta destreza con la habilidad Aporreo. Pero aun así, no es suficiente."
		},
		Summary = "Domina la habilidad Aporreo y regresa con Shurank."
	},
	[8214] = {
		Title = "La lección de Shurank",
		Description = {
			"¡Esos callos…! Solo alguien que domina la habilidad Aporreo tiene ese tipo de manos. Buen trabajo, espadachín. Estoy muy impresionado."
		},
		Summary = "Escucha la lección de Shurank."
	},
	[8215] = {
		Title = "La lección de Shurank",
		Description = {
			"A estas alturas, creo que sabes lo suficiente sobre la habilidad Aumentar recuperación de PV. La próxima vez, te enseñaré lo que sé sobre la habilidad Provocación."
		},
		Summary = "Escucha la lección de Shurank."
	},
	[8216] = {
		Title = "La orden de Shurank",
		Description = {
			"Deseo que encuentres a un Caballero llamado ^5D478BDequ'ee^000000 en ^5D478BGeffen^000000. Escucha atentamente el mensaje: ^0000FF¿Qué le pasó al asesino?^000000 ^0000FF¿Averiguaste quién es? Si lo hiciste, ¿qué se supone que tenemos que hacer ahora?^000000"
		},
		Summary = "Entrega el mensaje de Shurank a Dequ'ee en Geffen."
	},
	[8217] = {
		Title = "El mensaje Dequ'ee",
		Description = {
			"Así que Shurank pregunta: ¿Qué le pasó al asesino? ¿Averiguaste quién es? Si lo hiciste, ¿qué se supone que tenemos que hacer ahora? No hemos averiguado con certeza quién es el asesino. Sin embargo, tenemos una lista de sospechosos y lo descubriremos pronto."
		},
		Summary = "Entrega el mensaje de Dequ'ee a Shurank en Izlude."
	},
	[8218] = {
		Title = "La lección de Shurank",
		Description = {
			"¿Aún no has aprendido la habilidad Provocación? Ahora te pido que entrenes en el uso de Provocación."
		},
		Summary = "Domina la habilidad Provocación y regresa con Shurank."
	},
	[8219] = {
		Title = "La lección de Shurank",
		Description = {
			"Mmm. Parece que tienes una comprensión básica de Provocación, pero déjame darte algunos detalles para que puedas entender mejor el uso de esa habilidad."
		},
		Summary = "Domina la habilidad Provocación y regresa con Shurank."
	},
	[8220] = {
		Title = "La lección de Shurank",
		Description = {
			"Ah, veo que entiendes bastante sobre la habilidad Provocación. La próxima vez que hablemos, te contaré lo que sé sobre la habilidad ^5D478BAguante^000000. Regresa cuando te hayas preparado para aprender."
		},
		Summary = "Escucha la lección de Shurank."
	},
	[8221] = {
		Title = "La lección de Shurank",
		Description = {
			"Al activar Aguante, podrás esquivar los ataques. Recibirás algo de daño, pero los ataques enemigos no te afectarán tanto. Eso significa que puedes contrarrestar los ataques enemigos o escapar si es necesario. Muy bien. Ahora quiero que entrenes en el uso de la habilidad Aguante. Puedes convertirte en un gran Espadachín."
		},
		Summary = "Domina la habilidad Aguante y regresa con Shurank."
	},
	[8222] = {
		Title = "La orden de Shurank",
		Description = {
			"Ah, una vez más, tengo otra tarea que tienes que cumplir. Visita a Dequ'ee en Geffen, ya que parece que tiene algo que pedirte. Date prisa y visita a Dequ'ee. Regresa conmigo cuando hagas lo que quiere que hagas."
		},
		Summary = "Reúnete con Dequ'ee."
	},
	[8223] = {
		Title = "La orden de Dequ'ee",
		Description = {
			"Ahora, quiero que vayas a Morroc e interrogues a cuatro sospechosos. Sus nombres son ^5D478BMuetro^000000, ^5D478BGeil^000000, ^5D478BHans^000000 y ^5D478BBankley^000000. No debería ser muy difícil. Cuando hables con todos, regresa e infórmame."
		},
		Summary = "Regresa con Dequ'ee después de encontrar las pruebas en Morroc."
	},
	[8224] = {
		Title = "La pista",
		Description = {
			"¡Qué genial…! Bueno, bueno, buen trabajo. Ahora todo lo que tenemos que hacer es averiguar qué significa todo esto. Esto va a ser muy difícil. Tenemos que resolver esto, es la única pista que tenemos…"
		},
		Summary = " "
	},
	[8225] = {
		Title = "El razonamiento de Dequ'ee",
		Description = {
			"¡Muy bien! ¡Parece que Bankley es el asesino! Aunque no podemos confiar en esto con certeza, estas pruebas son bastante concluyentes. Date prisa en ir a Morroc y vigila a Bankley por si hace algo desesperado. Si pasa algo, infórmame de inmediato!"
		},
		Summary = "Observa de cerca a Bankley en Morroc."
	},
	[8226] = {
		Title = "La muerte de Bankley",
		Description = {
			"- ¡Está muerto!  Bankley tenía una expresión triste y lamentable en su rostro. Dado que sus mejillas todavía tienen color, diría que murió hace poco tiempo. Tiene una herida larga y profunda en su pecho; y su mano derecha aprieta un cuchillo empapado en sangre. -"
		},
		Summary = "Comunica la muerte de Bankley a Dequ'ee."
	},
	[8227] = {
		Title = "Regresa con Shurank",
		Description = {
			"¿Un suicidio…? ¡Aquí hay algo que huele mal! En cuanto a los otros tres sospechosos, me aseguraré de que los miembros de la Asociación de Espadachines los vigilen. Parece que este caso está cerrado por ahora. Una vez más, gracias por tu ayuda. ¿Por qué no se le informas a Shurank ahora? Supongo que todavía quiere mostrarte el manejo del arte de la espada."
		},
		Summary = "Regresa con Shurank"
	},
	[8228] = {
		Title = "La lección de Shurank",
