	[11070] = {
		Title = "El Rey del veneno",
		Description = {
			"¿Por qué quieres aprender sobre eso? Aunque quisiera enseñarte, estoy demasiado viejo para acordarme de todo. Ve a buscar a mi último discípulo, ^0000FFSong Zhi Du^000000, para que te enseñe algo útil."
		},
		Summary = "Song Zhi Du está trabajando en el consultorio médico. Pregúntale sobre el uso de los venenos."
	},
	[11071] = {
		Title = "El Rey del veneno",
		Description = {
			"Anda a hacer lo que ibas a hacer. Solo estoy decepcionado…"
		},
		Summary = "Parece que Song Zhi Du se molestó. Puedo traerle algo para que se sienta mejor."
	},
	[11072] = {
		Title = "El Rey del veneno",
		Description = {
			"Si realmente me tienes lástima, ¡entonces debes ayudarme a llevar a cabo mi venganza! Ve a buscarme ^0000FF4 Aguijones de abeja, 10 Colmillos venenosos, 10 Botellas de poción vacías, 30 Pociones verdes^000000."
		},
		Summary = "Regresa con Song Zhi Du con los materiales que te pidió."
	},
	[11073] = {
		Title = "El Rey del veneno",
		Description = {
			"Lo único que queda es preparar este veneno y hacer que el señor de Louyang lo beba…"
		},
		Summary = "Vuelve a hablar con él y escucha la historia, luego hazle el favor a Song Zhi Du."
	},
	[11074] = {
		Title = "El Rey del veneno",
		Description = {
			"Ahora que la cuenta está pagada, llévale esto a Song Zhi Du."
		},
		Summary = "Obtuviste el material. Regresa con Song Zhi Du."
	},
	[11075] = {
		Title = "El Rey del veneno",
		Description = {
			"¡¡No!! ¡Volví a fallar! Y pensar que pasé mucho tiempo preparando todos esos materiales…"
		},
		Summary = "Se necesitan más materiales."
	},
	[11076] = {
		Title = "El Rey del veneno",
		Description = {
			"Infíltrate en el castillo del dragón. Quiero que pongas este veneno en algún lugar donde el señor Bai Long podría quedarse. De todos modos, sé muy bien que mi amo se alegrará de saber que por fin pude crear el ^0000Ffveneno que deseaba crear^000000."
		},
		Summary = "¿Qué debo hacer?"
	},
	[11077] = {
		Title = "El Rey del veneno",
		Description = {
			"Encontraste una botella que quizá le pertenezca a Bai Long, el señor de Louyang. Coloca el Veneno mortal encantador en la botella."
		},
		Summary = "Hiciste lo que Song Zhi Du te pidió. Regresemos."
	},
	[11078] = {
		Title = "El Rey del veneno",
		Description = {
			"Cuéntale a Nagash Arses cómo Song Zhi Du creó esta botella de Veneno mortal encantador y su plan para vengarse del señor de Louyang."
		},
		Summary = "Parece que necesita un tiempo a solas."
	},
	[11079] = {
		Title = "El Rey del veneno",
		Description = {
			"Te lo ruego. No dejes que le haga daño al señor. No tengo dudas de que te ha pedido ayuda, y también a otros… Por favor, no dejes que lleve a cabo su plan."
		},
		Summary = "Deshazte de la botella de Bai Long."
	},
	[11080] = {
		Title = "El Rey del veneno",
		Description = {
			"Toma la botella y reemplázala por una llena de Moco pegajoso. ¡Esperemos que Bai Long no se dé cuenta!"
		},
		Summary = "¡Pudiste reemplazarla! Regresa con Nagash Arses."
	},
	[11081] = {
		Title = "El Rey del veneno",
		Description = {
			"Este es un diario que he estado escribiendo durante 15 años sobre mis sentimientos de culpa, y lo que realmente sucedió en el pasado. Espero que puedas entregar esto al señor de mi parte."
		},
		Summary = "Entrega el Diario de Nagash Arses al señor."
	},
	[11082] = {
		Title = "El Rey del veneno",
		Description = {
			"Por favor, toma esto como una muestra de gratitud. Y, por favor, entrega esta carta a Nagash y Song Zhi Du de mi parte."
		},
		Summary = "El Diario fue entregado. Entrega la Carta a Nagash."
	},
	[11083] = {
		Title = "El Rey del veneno",
		Description = {
			"… ¡Oh~, gracias, muchas gracias!"
		},
		Summary = "Nagash Arses parece estar satisfecho. Dale la noticia a Song Zhi Du."
	},
