		Summary = "Regresa con Pauchon."
	},
	[11204] = {
		Title = "Pueblo de Mora…",
		Description = {
			"Es un tipo muy voluble, así que es posible que ya se haya ido. Pero se suponía que nos encontraríamos en el pueblo de Mora."
		},
		Summary = "Encuentra al amigo de Pauchon, Humming, en el pueblo de Mora."
	},
	[11205] = {
		Title = "El amigo de Pauchon",
		Description = {
			"Si llegas a Splendide antes que yo, dile a Pauchon que voy a atravesar el Laberinto del Bosque brumoso."
		},
		Summary = "Regresa con Pauchon."
	},
	[11206] = {
		Title = "Entrega rápida",
		Description = {
			"Si piensas volver a Splendide, haz una visita a Jones en la posada. Tiene algo que se debe entregar con urgencia al ejército de Splendide."
		},
		Summary = "Encuentra a Jones en el pueblo de Mora."
	},
	[11207] = {
		Title = "Una carga muy pesada",
		Description = {
			"Llevas demasiado peso. Reduce un poco tu carga y regresa."
		},
		Summary = "Reduce el peso de tu inventario y vuelve a hablar con Jones."
	},
	[11208] = {
		Title = "Daphrer",
		Description = {
			"Cuídalo mucho por favor. Es para Daphrer en Splendide."
		},
		Summary = "Lleva el Kit de suministros a Daphrer."
	},
	[11209] = {
		Title = "La angustia del Sr. Tomas",
		Description = {
			"Todos los humanos que visitan Malangdo vienen a verme, por eso tengo tanto trabajo. Hay una ^0000FFreunión ordinaria de Malangdo^000000, solo tienes que ir. Se celebrará en ^0000FFel lugar opuesto del extremo del corredor^000000."
		},
		Summary = "Participa en la reunión."
	},
	[11210] = {
		Title = "Reunión ordinaria de Malangdo",
		Description = {
			"El programa de hoy es sobre ^ff99ccDulce estelar^000000. Si alguien tiene una opinión sobre el próximo tema, que hable ahora."
		},
		Summary = "Escuchemos la opinión de Scottfold."
	},
	[11211] = {
		Title = "Reunión ordinaria de Malangdo",
		Description = {
			"El ^0000FFintérprete Galleta^000000 está junto a él, pero es difícil poder conversar detalladamente."
		},
		Summary = "Escuchemos la opinión de Koon."
	},
	[11212] = {
		Title = "Reunión ordinaria de Malangdo",
		Description = {
			"Permítanme hablarles sobre el desarrollo de la investigación."
		},
		Summary = "Escuchemos lo que el lingüista Devore tiene que decir sobre el desarrollo del estudio."
	},
	[11213] = {
		Title = "Reunión ordinaria de Malangdo",
		Description = {
			"El ^0000FFestudio del idioma de las estrellas de mar^000000 comenzó cuando echamos raíces en Malangdo, pero no obtuvimos los resultados que esperaba. Es posible tener una conversación sencilla, pero el desempeño es insatisfactorio."
		},
		Summary = "Escuchemos lo que la geóloga Mali tiene que decir sobre el desarrollo del estudio."
	},
	[11214] = {
		Title = "Reunión ordinaria de Malangdo",
		Description = {
			"Hay varias grietas en el suelo. Tenemos que repararlas rápidamente porque nadie sabe cuándo Dulce estelar se moverá."
		},
		Summary = "Escuchemos la opinión de Brie."
	},
	[11215] = {
		Title = "Reunión ordinaria de Malangdo",
		Description = {
			"Entendemos muy bien que la lesión del Sr. Rican podría afectar el comercio de Frutos de Yggdrasil, así que no hay que preocuparse por eso."
		},
		Summary = "Escuchemos la historia de Brie."
	},
	[11216] = {
		Title = "El Fruto de Yggdrasil",
		Description = {
			"Bueno, no conozco los detalles del Fruto de Yggdrasil. Si tienes alguna pregunta, solo tienes que ir a mi casa en ^6666ccMalangdo oeste^000000. Mi padre debe estar aburridísimo ahí…"
		},
		Summary = "Conozcamos al padre de Brie, el Sr. Rican."
	},
	[11217] = {
		Title = "El Fruto de Yggdrasil",
		Description = {
			"^6666ccEl Fruto de Yggdrasil está en todas partes.^000000Es muy fácil conseguirlo en la isla Malangdo, así que tráeme 30, por favor."
		},
		Summary = "Llevemos 30 Frutos de Yggdrasil frescos."
	},
	[11218] = {
		Title = "El Fruto de Yggdrasil",
		Description = {
			"¿Puedes poner el Fruto de Yggdrasil en la máquina?"
		},
		Summary = "Pongamos el Fruto de Yggdrasil en esa máquina."
	},
	[11219] = {
		Title = "El Fruto de Yggdrasil",
		Description = {
			"Al presionar el botón, la máquina empezó a funcionar."
		},
		Summary = "Hablemos con Rican."
	},
	[11220] = {
		Title = "El Fruto de Yggdrasil",
		Description = {
			"Después de que me lesioné la rodilla, empezó a visitar a la Dra. Mali todos los días. Si ves a mi hijo, dile que regrese~."
		},
		Summary = "Busquemos a Brie."
	},
	[11221] = {
