	[11284] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Parecen sucios, pero los Vendajes podridos se sumergieron en un jugo especial y tienen poderes especiales. Solo se necesitan 2 de estos vendajes para envolver ambos pies."
		},
		Summary = "Entrega 2 Vendajes podridos y regresa para hablar."
	},
	[11285] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"No sé si la puerta está cerrada o atascada, pero como no se puede abrir sola, unamos fuerzas."
		},
		Summary = "Abre la puerta con Las."
	},
	[11286] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Empujaste la puerta con todas tus fuerzas, pero no se movió."
		},
		Summary = "Habla con Las."
	},
	[11287] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Volveré a comunicarme con la oficina central. ¿Puedes preguntarle a los aldeanos sobre este hospital?"
		},
		Summary = "Habla con la aldeana de la derecha."
	},
	[11288] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"La verdad es que no sé. El hospital lleva mucho tiempo cerrado. Es extraño que venga una nueva enfermera."
		},
		Summary = "Parece que la aldeana no sabe mucho. Regresa con Las."
	},
	[11289] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"La oficina central no me enviaría a un sitio así si no estuvieran seguros. ¿Puedes intentar hablar con otro aldeano?"
		},
		Summary = "Habla con el aldeano al sur del hospital."
	},
	[11290] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Tendré que comunicar esta información lo antes posible. Perdona, pero ¿podrías ir a la posada en medio de la aldea con la enfermera?"
		},
		Summary = "Regresa con Las por ahora."
	},
	[11291] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Me duelen los pies y ya no puedo moverme. ¿Puedes ir a la posada sin mí?"
		},
		Summary = "Reúnete con el médico en la posada del centro de la aldea."
	},
	[11292] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Ahora no puedo ir al hospital porque tengo pacientes que cuidar. ¿Puedes volver con la llave y decirle que haga lo que quiera?"
		},
		Summary = "Regresa con Las."
	},
	[11293] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Coloca la llave en el ojo de la cerradura de la puerta del hospital. Pero parece que la puerta no está cerrada."
		},
		Summary = "Habla con Las."
	},
	[11294] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Parece que la voz viene desde el césped cerca de la entrada del hospital."
		},
		Summary = "Investiga la zona."
	},
	[11295] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"No busqué bien por temor a que me descubrieran, pero recuerdo haber visto una vara cuando fui hace mucho tiempo, después de que mi abuela murió."
		},
		Summary = "Investiga los alrededores del hospital."
	},
	[11296] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Sacaste la vara que estaba muy enterrada. El ambiente melancólico del hospital parece intensificarse."
		},
		Summary = "Será mejor que le lleve este Agimat a Las."
	},
	[11297] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"¿Podrías visitar a mi abuela? Iré a inspeccionar el hospital."
		},
		Summary = "Visita a su abuela en el oeste de la aldea, un poco al norte del hospital."
	},
	[11298] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Esperaba que ocurriera algo así cuando talaron el árbol antiguo de la aldea para construir el hospital."
		},
		Summary = "Continúa hablando con la abuela."
	},
	[11299] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"La enfermera Las podría estar en peligro frente al hospital y sola."
		},
		Summary = "Vuelve al hospital."
	},
	[11300] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Entremos a la vez, la puerta del piso 1 está abierta."
		},
		Summary = "Habla con Las dentro del hospital."
	},
	[11301] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Estuve explorando, pero es posible que no haya visto todo. ¿Podrías dar un vistazo en la entrada del piso 2?"
		},
		Summary = "Investiga la entrada del piso 2."
	},
	[11302] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
			"Encontré un Agimat. Busquemos más. Es extraño encontrar algo así en un sitio como este."
		},
		Summary = "Está cerca."
	},
	[11303] = {
		Title = "La enfermera de Puerto Malaya",
		Description = {
