		Title = "Cambio de clase a Guardia real",
		Description = {
			"La inscripción dice: “Eres tú quien tiene el poder sagrado… Encuentra mi recuerdo cerca de mi viejo castillo de Glastheim. Mis aposentos estaban al norte…”."
		},
		Summary = ""
	},
	[12096] = {
		Title = "Cambio de clase a Conjurador",
		Description = {
			"Encuentra a Karacas en el piso 4 de la Torre de Geffen."
		},
		Summary = "Conversación con Karacas."
	},
	[12097] = {
		Title = "Cambio de clase a Conjurador",
		Description = {
			"Trae estos materiales a Karacas en la Torre de Geffen para comenzar la prueba. 3 unidades de Viento de verdor, 3 de Azul cristal, 3 de Sangre roja y 3 de Vida verde."
		},
		Summary = ""
	},
	[12098] = {
		Title = "Recorrido por la mazmorra",
		Description = {
			"Lleva las 4 piedras distintas a estas ubicaciones: piso 1 de la Cueva de hielo, piso 1 de la mazmorra del volcán Thor, piso 3 de la Fosa abandonada de Mjolnir, piso 2 de la mazmorra de Kunlun y encuentra los detectores de espíritus."
		},
		Summary = "Si logras recolectar 3 tipos diferentes de reactivos, llévalos a Karacas en la Torre de Geffen."
	},
	[12099] = {
		Title = "Eliminar la causa raíz",
		Description = {
			"Se dice que están naciendo crías de Dragón cerca de las raíces de Yggdrasil. Eliminar a las crías de Dragón es importante porque, con el tiempo, se convertirán en adultos malvados. Tenemos que eliminarlas mientras sean jóvenes."
		},
		Summary = "Caza 10 Huevos de Dragón. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12100] = {
		Title = "Insecto alado violento",
		Description = {
			"Recibimos informes de avistamientos recientes de un enorme insecto alado desconocido cerca del campamento de los laphines. No sabemos hasta dónde puede extenderse la infestación de este insecto. Así que extermina a todos los que veas."
		},
		Summary = "Caza 12 Luciola Vespa. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12101] = {
		Title = "Interferencia en el trabajo",
		Description = {
			"Acaba de llegar esto de unos colegas que trabajan en la mina. Las crías de Dragón que viven cerca de las raíces de Yggdrasil están destruyendo las tierras cercanas a las minas. Será peligroso si no nos encargamos de esto. Acaba con las crías de Dragón cerca de Yggdrasil."
		},
		Summary = "Caza 5 Dragones. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12102] = {
		Title = "Serpientes astutas",
		Description = {
			"Una nueva raza llamada Naga fue encontrada en el pantano cerca del campamento de los laphines. El problema es que son monstruos astutas, primitivas y violentas. Si amplían su colonia, tendremos muchos conflictos con ellos. Por favor, acaba con los Naga adultos."
		},
		Summary = "Caza 10 Naga. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12103] = {
		Title = "Criatura legendaria",
		Description = {
			"Recibimos continuos informes de avistamientos de un legendario caballo blanco con alas cerca de la base de los laphines. ¿Podrías ir a dar un vistazo? Quizá sea una alucinación, así que asegúrate de tocarlo con la mano para comprobar que se trata de una criatura real."
		},
		Summary = "Caza 1 Cornus. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12104] = {
		Title = "Insectos hambrientos",
		Description = {
			"La reproducción de las Escolopendras es otro problema, y su apetito también amenaza nuestra supervivencia. Absorben el Mineral de bradium y dañan nuestros terrenos mineros. Muchos de nuestros colegas saphas perdieron sus vidas debido a las Escolopendras. Extermínalas, por favor."
		},
		Summary = "Caza 15 Escolopendras. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12105] = {
		Title = "Rocas móviles",
		Description = {
			"Obtuve un informe que indica que el Mineral de bradium en bruto de las minas cobró vida. Parece que el Mineral de bradium en bruto se convirtió en monstruos Gólem debido a un antiguo hechizo. Ahora nos enfrentamos a la posibilidad de tener que cerrar nuestras minas por ellos. ¿Puedes eliminarlos?"
		},
		Summary = "Caza 10 Gólem de bradium cerca del campo Manuk 2. Preséntate con el administrador de Caza 1 en menos de 23 horas."
	},
	[12106] = {
		Title = "Un niño sobre una flor",
		Description = {
			"Unos monstruos con aspecto de niños adorables están atacando a nuestro explorador que fue a Splendide. Inevitablemente, debemos cazarlos, y tú eres quien mejor encaja para la tarea porque no eres laphine."
		},
		Summary = "Caza 15 Pinguicula. Preséntate con el administrador de Caza 2 en menos de 23 horas."
	},
	[12107] = {
		Title = "Amor retorcido",
		Description = {
			"¿Conoces la flor con aspecto de niño, Pinguicula? La gente dice que la flor sufrió una mutación. Son muy violentas y agresivas. Ve a confirmarlo y encárgate de ellas antes de que se propaguen por toda la zona."
		},
		Summary = "Caza 10 Pinguicula oscuras en la mazmorra de Nidhogg. Preséntate con el administrador de Caza 2 en menos de 23 horas."
	},
	[12108] = {
		Title = "Eliminación de plantas peligrosas",
		Description = {
			"Desaparecieron unos recolectores de mineral. Y parece que los culpables son los Nepenthes. Los Nepenthes se parecen a las Mandrágoras. Tenemos que hacer algo para proteger a la gente de más daños."
		},
		Summary = "Caza 12 Nepenthes. Preséntate con el administrador de Caza 2 en menos de 23 horas."
	},
	[12109] = {
		Title = "Exterminación de Larvas",
		Description = {
			"Descubrieron el hábitat de la Larva de Escolopendra. Podemos eliminarlas ahora para reducir la población de Escolopendra. ¿Puedes buscarlas y matarlas? Ten cuidado porque las Escolopendra rondan cerca de ellas."
		},
		Summary = "Caza 14 Larvas de Escolopendra. Preséntate con el administrador de Caza 2 en menos de 23 horas."
	},
	[12110] = {
		Title = "Demonio del agua",
		Description = {
			"Los mineros que se dirigían al nido de Nidhogg informaron que una extraña criatura acuática los atacó. Dicen que era una criatura acuática con aspecto humano. Tal vez la mazmorra de Nidhogg sea el origen, así que visita el lugar para comprobarlo."
		},
		Summary = "Caza 7 Elementales de agua. Preséntate con el administrador de Caza 2 en menos de 23 horas."
	},
	[12111] = {
		Title = "Pájaro de cara fea",
		Description = {
			"Los Tatacho una vez fueron aves hermosas y podían volar. Pero desde que se asentaron aquí, donde no tienen enemigos naturales, empezaron a volverse gordos y perezosos. Con el tiempo, se volvieron en lo que son ahora, unos pájaros horribles. No tengo dudas de que tú y ellos se convertirán en enemigos naturales."
		},
		Summary = "Caza 10 Tatacho. Preséntate con el administrador de Caza 2 en menos de 23 horas."
	},
	[12117] = {
		Title = "Flor marchita",
		Description = {
			"Esta zona fue un humedal hace mucho tiempo. Pero, por alguna razón, el entorno cambió con los años. Hay un terreno preservado cerca del campamento de los laphines. ¿Puedes traerme una muestra de Flor marchita? Será para investigar los cambios medioambientales."
		},
		Summary = "Recolecta 6 Flores marchitas. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12118] = {
		Title = "Un mineral necesario",
		Description = {
			"La maquinaria de refinado de bradium está averiada y ahora no te tenemos bradium refinado suficiente para entregar para a nuestros colegas que trabajan en la mina. Así que todos nuestros trotamundos nos están ayudando a recolectar bradium refinado. Por favor, trae 3 unidades de bradium refinado del Gólem de bradium."
		},
		Summary = "Recolecta 3 unidades de bradium refinado. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12119] = {
		Title = "Tejidos valiosos",
		Description = {
			"Tengo una solicitud para traer 16 Crines de dragón. Las Crines de dragón solo los sueltan los monstruos Draco en pequeñas cantidades y son muy valiosos. Se utilizan en nuestros diseños autóctonos en nuestras banderas, ropa y equipamiento de campo."
		},
		Summary = "Recolecta 16 Crines de dragón. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12120] = {
		Title = "Carne peculiar",
		Description = {
			"Es una solicitud de la cantina para conseguir alimentos de gente de otros mundos. Quieren usar Colas de dragón como ingrediente para preparar los alimentos del campo y que se puedan almacenar en grandes cantidades. Así que a los humanos les gusta esto. Trae 6 unidades."
		},
		Summary = "Recolecta 6 Colas de dragón. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12121] = {
		Title = "Materiales para quitar la nieve",
		Description = {
			"El camino para salir de la ciudad ahora es una carretera con hielo peligrosa debido a la nieve que está cayendo. Esparcir trozos de Cáscara de huevo ayudará con eso. Y, necesitamos muchos. Unos 26 más o menos serán suficientes."
		},
		Summary = "Recolecta 26 piezas de Cáscara de huevo. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12122] = {
		Title = "El mejor material refrescante",
		Description = {
			"La maquinaria de procesamiento bradium emite un calor tremendo cuando se utiliza y no se puede estabilizar con ningún tipo de agua. Así que mezclamos Lágrimas cristalizadas obtenidas de los Elemental de agua de la nieve derretida. Las necesitamos todos los días, trae 6 unidades por favor."
		},
		Summary = "Recolecta 6 Lágrimas cristalizadas. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12123] = {
		Title = "La mejor pintura",
		Description = {
			"El administrador de suministros solicita pintura urgentemente para hacerle mantenimiento a los edificios de toda la ciudad. Puede preparar suficiente pintura con el Líquido fluorescente que se obtiene de los monstruos Elemental de agua. Tráeme 26 contenedores."
		},
		Summary = "Recolecta 26 contenedores de Líquido fluorescente. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12124] = {
		Title = "Objeto valioso raro",
		Description = {
			"La valiosa botella de agua para interiores en la habitación del ministro está rota. No podrán encontrar quién lo hizo porque todos los días se reciben muchos visitantes. ¿Puedes traerme este objeto valioso de Elemental de agua? Solo necesito uno."
		},
		Summary = "Recolecta 1 Botella pequeña. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12125] = {
		Title = "Material de armería",
		Description = {
			"Se acabaron todos los suministros para los revestimientos de las armaduras de los guardias. La coraza escamosa de Naga es un material de revestimiento perfecto. Tráeme 18 unidades."
		},
		Summary = "Recolecta 18 Corazas escamosas. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12126] = {
		Title = "Material de armería avanzado",
		Description = {
			"Te conseguí una solicitud llamada “material de revestimiento para las armaduras proporcionadas a los comandantes de la guardia”. Es diferente al revestimiento común. Tráeme 11 Escamas brillantes de Naga. No creo que te cause muchos problemas."
		},
		Summary = "Recolecta 11 Escamas brillantes. Preséntate con el administrador de suministros 1 en menos de 23 horas."
	},
	[12127] = {
		Title = "Herramienta del supervisor",
		Description = {
			"Es hora de reparar las trompetas para los supervisores de minas. Esas trompetas son necesarias para controlar a los mineros. El Cuerno místico de Cornus es la trompeta perfecta. Trae 5 de ellos."
		},
		Summary = "Recolecta 5 Cuernos místicos. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12128] = {
		Title = "Preparación para el calentamiento",
		Description = {
			"Parece que no hay pieles suficientes para los trotamundos. Será necesario conseguir pieles de Tatacho. 21 trozos serán suficientes."
		},
		Summary = "Recolecta 21 Pieles. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12129] = {
		Title = "Alimentos sospechosos",
		Description = {
			"Hubo una solicitud de la cantina para recoger 27 Patas de bicho. No quieren revelar la razón de por qué las necesitan. De todos modos, gracias."
		},
		Summary = "Recolecta 27 Patas de bicho. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12130] = {
		Title = "Material útil",
		Description = {
			"El Zargón es muy popular entre los residentes de aquí. Es una hermosa esfera que se puede usar como adhesivo si se pulveriza y se mezcla con agua. ¿Quieres? Será suficiente con 26 unidades de Zargón."
		},
		Summary = "Recolecta 26 unidades de Zargón. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12131] = {
		Title = "Material esencial para la construcción",
		Description = {
			"Hay una solicitud que consiste en encontrar un material que se usará en las obras de reparación de los edificios de los cuarteles. Consigue 13 Caparazones sólidos que se pueden obtener de los monstruos Escolopendra y Larva de escolopendra. Será muy útil para los trabajos de reparación."
		},
		Summary = "Recolecta 13 Caparazones sólidos. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12132] = {
		Title = "Material esencial para la construcción 2",
		Description = {
			"Hay una solicitud que consiste en encontrar un material que se usará en las obras de reparación de los edificios de los cuarteles. Consigue 16 Enredaderas fuertes que se pueden obtener de monstruos Nepenthes. Es un material vital para los trabajos de reparación de edificios."
		},
		Summary = "Recolecta 16 Enredaderas fuertes. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12133] = {
		Title = "Arreglo decorativo",
		Description = {
			"El guardia necesita muchas Hojas puntiagudas para decorar. Otros trotamundos ya empezaron a buscarlas. Necesitan muchas, así que consígueles 26 Hojas puntiagudas. Sé que es difícil. Te deseo buena suerte."
		},
		Summary = "Recolecta 26 Hojas puntiagudas. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12134] = {
		Title = "Contenedor instantáneo",
		Description = {
			"El dueño de la cantina tiene problemas debido a los muchos trotamundos extranjeros. Quisiera obtener un utensilio que se pueda usar fácil y rápidamente… Algo así como una hoja ancha."
		},
		Summary = "Recolecta 11 Hojas enormes. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12135] = {
		Title = "Sin suficientes medicinas",
		Description = {
			"Ha habido un par de ataques en la mina. Deben ser esos monstruos Nepenthes los que intentaron atacar a los mineros. Para hacer la medicina, necesitamos 16 Raíces terrosas. Búscalas y tráelas."
		},
		Summary = "Recolecta 16 Raíces terrosas. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12136] = {
		Title = "Ladrón de miel",
		Description = {
			"El dueño de la cantina vino y estuvo muy enfadado por ese gran apetito que tienen. Dijo que ya se le había acabado toda la miel y las frutas. 2 jarras de miel serán suficientes para calmarlo."
		},
		Summary = "Recolecta 2 unidades de Miel. Preséntate con el administrador de suministros 2 en menos de 23 horas."
	},
	[12137] = {
		Title = "Herramientas para los experimentos",
		Description = {
			"El centro de investigación industrial está buscando la forma de refinar el bradium con eficacia, pero nunca tienen suficientes materiales de prueba. Escuché que hay un comerciante en la ciudad de los trotamundos que vende Ollas de fuerza vital. Necesitaré 4."
		},
		Summary = "Recolecta 4 Ollas de fuerza vital. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12138] = {
		Title = "Muestras de regalos finos",
		Description = {
			"El dueño de la cantina dijo que quería hacer un regalo a todos sus clientes habituales de Sapha. Pero no sabe qué regalar. Si ves algún regalo interesante en Midgard, ¿puedes traer 5 de ellos?"
		},
		Summary = "Recolecta 5 Ramos. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12139] = {
		Title = "¡Respeto por el gusto!",
		Description = {
			"El alto ministro está buscando el producto de Midgard, la Rosa eterna. No sé si sea un buen regalo, pero… Así que… Sé que no es una tarea sencilla, pero tráeme 1 Rosa eterna. Esto es solo entre tú y yo."
		},
		Summary = "Recolecta 1 Rosa eterna. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12140] = {
		Title = "Cortesía para los habituales",
		Description = {
			"Una solicitud del dueño de la cantina. Dice que no puede usar platos de hojas desechables para los clientes habituales. Pide 15 Vajillas de porcelana blanca de Midgard."
		},
		Summary = "Recolecta 15 Vajillas de porcelana. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12141] = {
		Title = "Paquete especial",
		Description = {
			"Tengo una solicitud personal. Escuché que hay una artesanía redonda y transparente en Midgard. Creo que se llaman Cuentas de cristal. Aquí fabricamos objetos similares, pero no se comparan con lo elaborado de esas esferas. Por favor, consígueme 10."
		},
		Summary = "Recolecta 10 Cuentas de cristal. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12142] = {
		Title = "Solicitud peligrosa",
		Description = {
			"Mmm… No sé por dónde empezar. El alto ministro solicita marionetas de Midgard. No sé qué es, pero como el alto ministro lo pide, debe ser para un propósito muy importante. Trae 15 de ellos."
		},
		Summary = "Recolecta 15 Marionetas. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12143] = {
		Title = "Tendencia extraña",
		Description = {
			"Escuché que hay una moda entre muchos de mis colegas de aquí sobre un accesorio musical hecho de Pico de ave de Midgard. Estoy pensando en distribuirlos en el edificio de Operaciones. ¿Puedes comprar y traer 50 de ellos?"
		},
		Summary = "Recolecta 50 Picos de aves. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12144] = {
		Title = "Uso desconocido",
		Description = {
			"El dueño de la cantina dijo que quería decorarla con objetos llamados Caparazones de almejas. Trae 50 de ellas. No tengo idea cómo las usará para decorar, pero sus gustos se volvieron extravagantes luego de interactuar con tantos trotamundos."
		},
		Summary = "Recolecta 50 Caparazones de almejas. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12145] = {
		Title = "Cocinas de otros mundos",
		Description = {
			"No cocinamos para nosotros, pero a muchos trotamundos parece gustarles el arte de comer. El dueño de la cantina necesita un plato para su nueva cocina. Pidió 20 Caparazones de cangrejo. No tengo ni idea dónde podemos conseguirlos, pero… buena suerte."
		},
		Summary = "Recolecta 20 Caparazones de cangrejo. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12146] = {
		Title = "Relleno de grietas",
		Description = {
			"Creo que el objeto más útil de Midgard es el Scell. Usa los Scell para rellenar cualquier grieta o agujero en los edificios. Luego, mézclalo y agrega Garlet pulverizado para reparar los edificios de manera sencilla y rápida. ¿Puedes traer 30 unidades?"
		},
		Summary = "Recolecta 30 Scells. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12147] = {
		Title = "Material adhesivo",
		Description = {
			"Los Garlet son un elemento del mantenimiento de edificios. Es uno de los materiales más importantes en los edificios. Antes de que existiera el Garlet, triturábamos y utilizábamos el Zargón, pero ahora es difícil de conseguir. Trae 40 unidades."
		},
		Summary = "Recolecta 40 Garlets. Preséntate con el administrador de transporte 1 en menos de 23 horas."
	},
	[12148] = {
		Title = "Cebos para cazar monstruos Tatacho",
		Description = {
			"Esos monstruos Tatacho son muy rápidos cuando intentamos atraparlos y se nos hace muy difícil. Utiliza Comida para monstruos para atraer a los Galten. Se dice que hay un experto que hace ese trabajo. Trae 100 unidades de Comida para monstruos."
		},
		Summary = "Recolecta 100 unidades de Comida para monstruos. Preséntate con el administrador de transporte 2 en menos de 23 horas."
	},
	[12149] = {
		Title = "Práctica del arte de la espada",
		Description = {
			"El dueño de la cantina quiere algunas Manzanas para aprender a cocinar bien. Pero no conozco ningún trotamundos de Midgard que disfrute de ese alimento. De todas formas dice que lo intentará, así que consíguele 100 Manzanas."
		},
		Summary = "Recolecta 100 Manzanas. Preséntate con el administrador de transporte 2 en menos de 23 horas."
	},
	[12150] = {
		Title = "Un vegetal muy naranja",
		Description = {
			"Esta una solicitud del dueño de la cantina. Quiere algunos vegetales para preparar un plato colorido. Bueno… Zanahoria, ¿verdad? Creo que así se llaman en tu tierra. Estaba hablando conmigo misma. Trae 100 de ellas."
		},
		Summary = "Recolecta 100 Zanahorias. Preséntate con el administrador de transporte 2 en menos de 23 horas."
	},
	[12151] = {
		Title = "La tenacidad del dueño de la cantina",
		Description = {
			"Dicen que hubo explosión en la cantina. La gente dice que fue debido a un vegetal llamado Calabaza que se estaba asando en el fuego. Trae 100 calabazas porque ya no quedan."
		},
		Summary = "Recolecta 100 Calabazas. Preséntate con el administrador de transporte 2 en menos de 23 horas."
	},
	[12152] = {
		Title = "Sabe a comida casera",
		Description = {
			"El dueño de la cantina tiene otra solicitud… Extraña las papas que solía comer cuando era joven. Quiere 50 Batatas dulces. Si por casualidad vas a Midgard, intenta conseguirlas."
		},
		Summary = "Recolecta 50 Batatas dulces. Preséntate con el administrador de transporte 2 en menos de 23 horas."
	},
	[12153] = {
		Title = "Planta peligrosa cuando se quema",
		Description = {
			"El dueño de la cantina quiere cocinar algo extraño. Dijo que será Banana asada, pero creo que ya cocinado algo parecido… Bueno, no puedo recordar mucho. En fin… necesitas conseguir 100 Bananas."
		},
		Summary = "Recolecta 100 Bananas. Preséntate con el administrador de transporte 2 en menos de 23 horas."
	},
	[12154] = {
		Title = "Inesperadamente normal",
