		Title = "Información sobre Nigel, la persona desaparecida",
		Description = {
			"19 años. Un trotamundos que llegó en barco desde un lugar lejano y desconocido. Lleva 2 meses desaparecido desde que fue a explorar el laberinto con solo unas mallas delgadas, a pesar de las protestas de todos los habitantes de Mora."
