	[14118] = {
		Title = "La preocupación de Wuhari",
		Description = {
			"A Wuhari le preocupa que su hermano esté en prisión. Busca la manera de entrar a la prisión y entrega la conmovedora carta de Wuhari a su hermano en prisión."
		},
		Summary = ""
	},
	[14119] = {
		Title = "Prueba de paciencia 1",
		Description = {
			"El prisionero no responde cuando se le habla. Parece que quiere poner a prueba mi paciencia."
		},
		Summary = "“Conversación” con el prisionero."
	},
	[14120] = {
		Title = "Prueba de paciencia 2",
		Description = {
			"El prisionero sigue sin responder incluso después de hablarle varias veces. Intentémoslo de nuevo."
		},
		Summary = "“Conversación” con el prisionero."
	},
	[14121] = {
		Title = "Prueba de paciencia 3",
		Description = {
			"El tipo parece que quiere mantener la boca cerrada a toda costa. Me pregunto si hay alguna manera de hacerlo hablar."
		},
		Summary = "“Conversación” con el prisionero."
	},
	[14122] = {
		Title = "Tiempo para dos",
		Description = {
			"Wuhuru recibió la carta de Wuhari. Pidió un poco de tiempo para leer la carta. No lo molestes mientras lee la carta."
		},
		Summary = "Dale tiempo para leer la carta."
	},
	[14123] = {
		Title = "El favor de Wuhuru",
		Description = {
			"Después de leer la carta de su hermano, Wuhuru empezó a contarte su historia al detalle y te pidió que le envíes sus saludos a su hermano. Regresa con Wuhari y dale los saludos de su hermano."
		},
		Summary = "Dale los saludos a Wuhari."
	},
	[14124] = {
		Title = "El Escondite de los Remanentes",
		Description = {
			"Alguien robó los animales que Jade criaba anoche. Ve a investigar qué pasó e infórmame."
		},
		Summary = "A la Casa de Jade"
	},
	[14125] = {
		Title = "Inspección de la zona",
		Description = {
			"Wuhari está buscando la manera de recuperar el cuerpo de Wuhuru. Sin embargo, no sabe cómo. Quizá las personas de la zona cercana sepan algo. Inspecciona las zonas cercanas."
		},
		Summary = "Habla con la gente del pueblo."
	},
	[14126] = {
		Title = "En busca de la Srta. Goatie",
		Description = {
			"El Sr. Masione dice que no sabe mucho. Pero pide que le consulte a la Srta. Goatie, que es mucho más perspicaz con estas cosas."
		},
		Summary = "Busca a la Srta. Goatie."
	},
	[14127] = {
		Title = "En busca del esposo de la Srta. Goatie",
		Description = {
			"Mientras agitaba un trozo de papel en el aire, la Srta. Goatie habló de lo feliz que era Wuhuru. Cuando le preguntaste sobre el papel, dijo que quizá su esposo sepa más al respecto."
		},
		Summary = "Busca al esposo de la Srta. Goatie."
	},
	[14128] = {
		Title = "Obtener el informe de investigación",
		Description = {
			"El Sr. Svery, quien siempre tuvo una buena relación con Wuhuru, sabía algo más. Dentro de la carta que Wuhuru dejó antes de que se lo llevaran a prisión, estaba el informe de investigación. Llévaselo a Wuhari."
		},
		Summary = "Entrega del informe."
	},
	[14131] = {
		Title = "Tiempo para el análisis",
		Description = {
			"Wuhari recibió el informe, pero dijo que tomará un tiempo analizarlo. Intenta hablar con él un poco más tarde. No se debe molestar a nadie cuando está investigando."
		},
		Summary = "Tiempo para el análisis."
	},
	[14132] = {
		Title = "El Escondite de los Remanentes",
		Description = {
			"Primero, deberíamos investigar el corral donde estaban los animales."
		},
		Summary = "Investigar el Corral"
	},
	[14133] = {
		Title = "Otro favor",
		Description = {
			"Wuhari analizó el informe de investigación, pero aún no estaba seguro de cómo recuperar el cuerpo de su hermano. Intenta encontrarlo y pregunta al laphine que originalmente solicitó que Wuhuru participara en la investigación."
		},
		Summary = "Recopilación de las pruebas."
	},
	[14134] = {
		Title = "La perspicaz Srta. Goatie",
		Description = {
			"Si bien le pediste más información, el Sr. Svery dijo que no sabía nada sobre el laphine de alto nivel. Sin embargo, sugirió visitar a su esposa, quien es muy perspicaz con este tipo de situaciones."
		},
		Summary = "Con la Srta. Goatie."
	},
	[14135] = {
		Title = "En busca del Sr. Pompe",
		Description = {
			"Cuando le preguntaste por el paradero del laphine de alto nivel, la Srta. Goatie dijo no saber mucho. Sin embargo, un vecino del pueblo, el Sr. Pompe, dijo que vio en el campo al laphine que más tarde desapareció. Pidámosle más detalles al Sr. Pompe."
		},
		Summary = "Escucha la historia del Sr. Pompe."
	},
	[14136] = {
		Title = "Una escena terrible en el campo",
		Description = {
			"El Sr. Pompe tiene miedo de ir al campo. Dijo que, desde que un laphine de alto nivel tuvo una muerte terrible, hay un cadáver grande tendido en el suelo. Investiga el terreno."
		},
		Summary = "Investigación del campo."
	},
	[14137] = {
		Title = "Una propuesta interesante",
		Description = {
			"Una chica laphine tuvo una interesante propuesta. Parece ser que el laphine que le dio a Wuhuru el informe de investigación es el padre que perdió hace mucho tiempo. Vamos a buscarlo."
		},
		Summary = "Investigación del campo."
	},
	[14138] = {
		Title = "El cadáver grande",
		Description = {
			"Había un cadáver grande que parecía llevar ahí bastante tiempo. Era el laphine que todos buscaban. Tenemos que darle a la chica la mala noticia."
		},
		Summary = "Habla con Giranni."
	},
	[14139] = {
		Title = "Con Wuhuru",
		Description = {
			"La chica confirmó que el cadáver era de su padre. Tengo que regresar con Wuhari con las manos vacías, ya que el laphine que buscaba murió. Pero, antes, vamos a contarle a Wuhuru sobre el laphine con quien trabajó."
		},
		Summary = "Con Wuhuru."
	},
	[14140] = {
		Title = "Con Wuhari",
		Description = {
			"Wuhuru contó toda su historia, pero Wuhari no debe saber la historia completa. Ve con Wuhari y al menos dile que el laphine murió."
		},
		Summary = "Habla con Wuhari."
	},
	[14141] = {
		Title = "Ingredientes para la investigación",
		Description = {
			"Wuhari pidió ingredientes para poder hacer su propia investigación. Recolecta los ingredientes necesarios que Wuhari necesita. (1 trozo de Ala, 1 Pelo resistente, 1 unidad de Bradium, 1 Runa de la oscuridad, 1 Runa de sangre)."
		},
		Summary = "¡Consigue los objetos!"
	},
	[14142] = {
		Title = "¡A la Aldea de los Arqueros!",
		Description = {
			"Para terminar la lección, viaja a Payon y camina hacia el norte para que llegues al <NAVI>[Gremio de Arqueros]<INFO>payon_in02,62,67,0,100,0,0</INFO></NAVI>."
		},
		Summary = "Viaja a la Aldea de los Arqueros."
	},
	[14143] = {
		Title = "Solicitud de cambio de clase a Arquero",
		Description = {
			"¡Por fin solicité el cambio a la clase Arquero! Ve al gremio de Arqueros para hacer el cambio a la clase Arquero."
		},
		Summary = "Solicitud de cambio de clase."
	},
	[14144] = {
		Title = "Nueva prueba de estadísticas",
		Description = {
			"Vuelve a tomar la prueba una vez que hayas aprendido a fondo tus estadísticas."
		},
		Summary = "Vuelve a tomar la prueba de estadísticas."
	},
	[14145] = {
		Title = "Habilidades de Arquero",
		Description = {
			"Escucha los detalles de las habilidades de la clase Arquero."
		},
		Summary = ""
	},
	[14146] = {
		Title = "Entrenamiento de cacería",
		Description = {
			"La lección teórica es buena, ¡pero la práctica en el campo es lo mejor! Ve con el entrenador con vista de águila y haz el entrenamiento de cacería."
		},
		Summary = "Entrenamiento de cacería"
	},
	[14147] = {
