		Summary = "Vuelve a tomar la prueba de habilidades."
	},
	[14148] = {
		Title = "El siguiente paso",
		Description = {
			"Escucha la explicación sobre el cambio a segunda clase."
		},
		Summary = "Encuentra a Marlbron."
