	},
	[14478] = {
		Title = "En busca de la Pista",
		IconName = "ico_ep.bmp",
		Description = {
			"Una <NAVI>[criada]<INFO>prt_cas,322,216,0,101,0</INFO></NAVI> vino a limpiar la habitación. Vamos a preguntarle por el paradero de la caja."
