		Summary = "A la cocina real."
	},
	[14479] = {
		Title = "Una disculpa en forma de limpieza",
		IconName = "ico_ep.bmp",
		Description = {
			"¿Quién más estaba ahí? No lo sé… Quizá lo recuerde si <NAVI>[este lugar]<INFO>prt_cas,322,216,0,101,0</INFO></NAVI> vuelve a estar limpio. ¿Lo limpiarías por mí? ¡Gracias! Primero tienes que limpiar el moho de la pared, sacar la grasa y limpiar el piso."
		},
		Summary = "Empecemos a limpiar."
	},
	[14480] = {
		Title = "Conquistar la Grasa",
		IconName = "ico_ep.bmp",
		Description = {
			"Necesitas una mezcla de naranja y alcohol para limpiar la <NAVI>[grasa]<INFO>prt_cas,337,197,0,101,0</INFO></NAVI>. Trae 1 Naranja y 1 Alcohol."
		},
		Summary = "Consigue los materiales para la limpieza."
	},
	[14481] = {
		Title = "Conquistar el Moho",
		IconName = "ico_ep.bmp",
		Description = {
			"No puedes deshacerte del <NAVI>[moho]<INFO>prt_cas,337,212,0,101,0</INFO></NAVI> sin el poder de su propia especie y el poder de los dioses. ¡Trae 1 Polvo de Moho y 1 Agua Bendita!"
		},
		Summary = "Consigue los materiales para la limpieza."
	},
	[14482] = {
		Title = "Conquistar la Suciedad",
		IconName = "ico_ep.bmp",
		Description = {
			"Para eliminar el <NAVI>[objetivo]<INFO>prt_cas,309,215,0,101,0</INFO></NAVI>, necesitas 1 Limón y 1 Arena Fina. Ve a buscarlos. ¡Ve!"
		},
		Summary = "Consigue los materiales para la limpieza."
	},
	[14483] = {
		Title = "Limpieza Completada",
		IconName = "ico_ep.bmp",
		Description = {
			"Se completó la limpieza. Visita a la <NAVI>[criada]<INFO>prt_cas,322,216,0,101,0</INFO></NAVI> y escucha su historia."
		},
		Summary = "Con la criada."
	},
	[14484] = {
		Title = "Había un Repartidor de Muebles",
		IconName = "ico_ep.bmp",
		Description = {
			"Había un hombre que repartía los muebles todo el día. Por eso tuve que quedarme ahí todo el día limpiando la habitación. Debe estar <NAVI>[cerca de la oficina]<INFO>prontera,68,68,0,101,0</INFO></NAVI>. Hay muchas tiendas en la zona."
		},
		Summary = "Encuentra al Repartidor."
	},
	[14485] = {
		Title = "No lo soporto",
		IconName = "ico_ep.bmp",
		Description = {
			"Oh, fui una buena persona toda mi vida, ¿y esto es lo que me toca? <NAVI>[Yo]<INFO>prontera,68,68,0,101,0</INFO></NAVI> ya no tengo más fuerzas para seguir viviendo… Sin embargo, 3 Medallones de Ternera podrían levantarme el ánimo."
		},
		Summary = "Comida para el alma."
	},
	[14486] = {
		Title = "Escuché la historia",
		IconName = "ico_ep.bmp",
		Description = {
			"Ya conoces la historia. Regresemos al palacio para encontrarnos con <NAVI>[Jurgen]<INFO>prt_cas_q,95,9,0,101,0</INFO></NAVI>."
		},
		Summary = "Con Jurgen."
	},
	[14487] = {
		Title = "Valor Sentimental",
		IconName = "ico_ep.bmp",
		Description = {
			"Para animar a mi hermana, puede que tengamos que traer las cosas que tu hermana apreciaba. Traigamos 10 Piedras del Mar y 1 Rosa Eterna. Puedes conseguir las Piedras del Mar cuando caces Medusas. - <NAVI>[Jurgen]<INFO>prt_cas_q,95,9,0,101,0</INFO></NAVI> "
		},
		Summary = "Valor Sentimental"
	},
	[14488] = {
		Title = "Envíale mi Amor",
		Description = {
			"<NAVI>[Dile]<INFO>prt_cas,322,216,0,101,0</INFO></NAVI> que la amo. Ayúdame, por favor."
		},
		Summary = "Con la criada."
	},
	[14489] = {
		Title = "Tengo que Rechazarlo",
		Description = {
			"Nunca me esperé esto y me siento presionada. Además, tengo una razón por la que no puedo salir con nadie ahora. Hazle llegar mis palabras sin herir sus sentimientos. <NAVI>[Jurgen]<INFO>prt_cas_q,95,9,0,101,0</INFO></NAVI>"
		},
		Summary = "Con Jurgen."
	},
	[14490] = {
		Title = "Mi amor, una vez más",
		Description = {
			"Quiero demostrarle que mi corazón es tan grande como el océano y que mi pasión no tiene fin. Envíale mi amor con 15 Piedras del Mar, que se pueden conseguir cazando Medusas, y 1 Rosa Eterna. <NAVI>[criada]<INFO>prt_cas,322,216,0,101,0</INFO></NAVI>"
		},
		Summary = "El regalo para la criada."
	},
	[14491] = {
		Title = "Tengo que rechazarlo otra vez",
		Description = {
			"Lo siento… Pero en realidad soy… Díselo al príncipe <NAVI>[Wigner]<INFO>prt_cas_q,95,9,0,101,0</INFO></NAVI> sin herir sus sentimientos."
		},
		Summary = "Con Jurgen."
	},
	[14492] = {
		Title = "Un indicio de esperanza",
		IconName = "ico_dq.bmp",
		Description = {
			"¿Puedes volver más tarde? Solo el tiempo suficiente para que no se sienta presionada, pero que no me vaya a olvidar. Pasado un tiempo, ¡me gustaría volver a entregarle mi corazón! - <NAVI>[Jurgen]<INFO>prt_cas_q,95,9,0,101,0</INFO></NAVI>"
		},
		Summary = "Regresa más tarde."
	},
	[14493] = {
		Title = "Mis sentimientos el día de hoy",
		IconName = "ico_dq.bmp",
		Description = {
			"¿Qué debo hacer? Hoy Mary me gusta aún más. Envíale mi amor con 15 Piedras del Mar, que se pueden conseguir cazando Medusas, y 1 Rosa Eterna."
		},
		Summary = "El regalo para la criada."
	},
	[14494] = {
		Title = "Tengo que rechazarlo otra vez",
		IconName = "ico_dq.bmp",
		Description = {
			"Por favor, realmente aprecio sus sentimientos. Sin embargo, no puedo aceptarlo. Díselo sin herir sus sentimientos."
		},
		Summary = "Con Jurgen."
	},
