	},
	[14498] = {
		Title = "¿Qué rumor?",
		Description = {
			"Si en Prontera corre un rumor desagradable sobre nuestra familia, no puedo quedarme con los brazos cruzados. Necesito saber cuál es el rumor para poder hacer algo. Reúne toda la información sobre los rumores. Es posible que los niños pequeños lo sepan."
