	},
	[14499] = {
		Title = "Demuestra tu valía",
		Description = {
			"Demuestra que tienes derecho a escuchar la historia. Caza 33 Majoruros. Y trae el libro sobre la historia de Rune-Midgarts que está en la biblioteca. ¡Ah, también necesito 12 piezas de seda suave!"
