	[21227] = {
		Title = "¡Recolectar muestras es más difícil de lo que parece!",
		Description = {
			"Parece que un estudiante universitario que vino a la Isla Byalan a investigar tiene problemas y pidió que enviaran a alguien para ayudarlo. Viaja en barco desde el puerto de Izlude hasta la Isla Byalan y reúnete con Helden."
