	[60721] = {
		Title = "El sello de Megingjard",
		Description = {
			"Debería avisarle a Rebarev Doug que estoy a punto de irme. Pero primero, debo asegurarme de averiguar más sobre la última misión."
		},
		Summary = ""
	},
	[60722] = {
		Title = "El sello de Megingjard",
		Description = {"sin usar"},
		Summary = ""
	},
	[60723] = {
		Title = "El sello de Megingjard",
		Description = {
			"Pregunta al bibliotecario Jekan si descubrió algo más acerca de la última misión en los documentos del Primer Pelotón. Su visión es muy mala; necesita una Lupa y un Farol."
		},
		Summary = ""
	},
	[60724] = {
		Title = "El sello de Megingjard",
		Description = {
			"Parece que el bibliotecario Jekan está ocupado. Quizá debería leer algunos documentos y buscar en los estantes hasta que me diga en qué parte de los estantes están “Los registros de la Tercera Sección”."
		},
		Summary = ""
	},
	[60725] = {
		Title = "El sello de Megingjard",
		Description = {
			"Jekan necesitará algunos objetos para que haga las copias de los registros. 2 Papeles encerados y 1 Papel de aceite de Amatsu, 3 Plumas de ave de Morroc y 20 Gemas azules de Geffen."
		},
		Summary = "Lleva estos objetos a Jekan para que termine la copia más rápido."
	},
	[60726] = {
		Title = "El sello de Megingjard",
		Description = {
			"Tu copia de los registros tiene una extraña magia de búsqueda. Para encontrar información específica, primero debes buscar el tema más general y luego el más específico: Cruzado, Tercera Compañía, Tercera Sección, Primer Pelotón."
		},
		Summary = "Busca los nombres de cada miembro para descubrir dónde se encuentran en la actualidad."
	},
	[60727] = {
		Title = "El sello de Megingjard",
		Description = {
			"Encuentra a Zan Huadoku en el gremio de Herreros de Geffen. Asegúrate de mostrar el respeto y pregúntale cómo se encuentra antes de mencionar su última misión ultrasecreta. ¡Sí, esa es la clave!"
		},
		Summary = ""
	},
	[60728] = {
		Title = "El sello de Megingjard",
		Description = {
			"Zan Huadoku te dijo que todo lo que crees es posible. Debes dirigirte a Morroc para encontrar a Cuaque Donon, que fue visto por última vez en la posada. Tienes la sensación de que deberás ser insistente en Morroc."
		},
		Summary = ""
	},
	[60729] = {
		Title = "El sello de Megingjard",
		Description = {
			"Cuaque Donon está en el escondite del gremio de Pícaros, que probablemente esté en la Fortaleza de Saint Darmain (sur) [usa Ctrl + ~ en el mapa]. La contraseña que debes escribir es “Aragham nunca atesoró objetos de mejora”."
		},
		Summary = "Cuaque sufre de trastorno de estrés postraumático extremo y suele entrar en pánico. Así que trátalo como si fuera un niño pequeño o, incluso, un muñeco. Ja, ja, ja."
	},
	[60730] = {
		Title = "El sello de Megingjard",
		Description = {
			"Cuaque dijo que el pelotón encontró el “Megingjard” y estalló una discusión… Necesitas saber más sobre esa discusión. Quizá Jack. O. en los muelles de Alberta pueda ayudarte."
		},
		Summary = "Sigue siendo un Cruzado activo, así que creo que hablar con él será mucho más sencillo."
	},
	[60731] = {
		Title = "El sello de Megingjard",
		Description = {
			"Jack. O. se sintió un poco mejor con las Hierbas verdes.  Quizá debería compartir ese consejo con los demás Cruzados que encuentre.  Emma Searth está en Al De Baran. Tomaré un barco a Izlude y un teletransportador de Kafra y llegaré en un santiamén."
		},
		Summary = "Quizá también deba llevar algo que pueda ayudar a los Cruzados a recordar sus lugares. Algo como un Marcador de un Rideword."
	},
	[60732] = {
		Title = "El sello de Megingjard",
		Description = {
			"Creo que debo darme prisa para ver a Nuevegolpes, que trabaja como portero en la posada de Jawaii. Oí que un antiguo camarero de Jawaii trabaja en el bar Prontera Central. Tal vez sepa cómo llegar a Jawaii sin tener que tomar algo para el mareo."
		},
		Summary = "Nuevegolpes, un portero, parece no ser la clase de tipo que le guste hablar mucho. Debería seguir hablando con él hasta que, al menos, responda mis preguntas."
	},
	[60733] = {
		Title = "El sello de Megingjard",
		Description = {
			"Sal de Jawaii con un Ala de mariposa o bebe hasta que termines en Rune-Midgarts. Ve a Comodo y visita a Royal Myst en el casino del sur. La forma más fácil de teletransportarse a Comodo es a través de Morroc."
		},
		Summary = "Un par de tragos de Alcohol pueden hacer que Royal Myst suelte la lengua…"
	},
	[60734] = {
		Title = "El sello de Megingjard",
		Description = {
			"Hablaste con todos los Cruzados que siguen vivos, pero parece que algo ocurrió. Empezaron a culparse mutuamente y el Cruzado Egnigem murió durante los hechos. Debes volver al castillo de Prontera e informar tus hallazgos."
		},
		Summary = "Puedes llegar rápidamente si usas el teletransportador de Kafra desde Comodo hacia Morroc y hacia Prontera. A menos que tengas un punto de guardado en Prontera."
	},
	[60735] = {
		Title = "El sello de Megingjard",
		Description = {
			"Habla con el último miembro del Primer Pelotón, el fallecido Egnigem. Utiliza el teletransportador de Kafra desde Prontera hacia Morroc, hacia Comodo y, finalmente, hacia Umbala. Luego, viaja hacia el norte del Árbol de la vida y hacia Niflheim para que llegues adonde está."
		},
		Summary = "Escucha a Egnigem y piensa qué puedes hacer para solucionar esto."
	},
	[60736] = {
		Title = "El sello de Megingjard",
		Description = {
			"¡Por la misericordia de Odín, esto es terrible! Nunca penaste que un Cruzado virtuoso haría un acto tan malvado para capturar el poder del Megingjard. Sé valiente. Vuelve al Cuartel de los Cruzados y cuéntale a Max Von Shedough lo que sabes."
		},
		Summary = ""
	},
	[60737] = {
		Title = "El sello de Megingjard",
		Description = {
			"Max Von Shedough aceptó mi informe y está profundamente preocupado por su contenido. Pero algo medice que, a pesar de las buenas intenciones, la realidad política impedirá que se haga justicia."
		},
		Summary = "Debo contarle a Egnigem el resultado para que al menos sepa por qué murió."
	},
	[60738] = {
		Title = "El sello de Megingjard",
		Description = {
			"Egnigem te bendijo con toda la fuerza que le quedaba. Tienes la corazonada de que Egnigem querría que alguien especial para él supiera lo que le ocurrió. Debes contarle a Emma Searth lo que pasó."
		},
		Summary = ""
	},
	[60739] = {
		Title = "El sello de Megingjard",
		Description = {
			"A pesar de que no puede recordar, Emma siente la pérdida. Tu fe en la justicia se debilitó… Debes decirle a Max Von Shedough que él es el juez y, como tal, debe asumir su parte de la responsabilidad."
		},
		Summary = "Vuelve con Max Von Shedough en el castillo de Prontera."
	},
	[60801] = {
		Title = "El criador de mascotas de la GdE",
		Description = {
			"Espera que termine el tiempo de espera antes de alquilar otra montura del criador de mascotas fuera de los Reinos de la GdE."
		},
		Summary = ""
	},
	[60810] = {
		Title = "Acceso VIP limitado",
		Description = {
			"Durante 3 días, esto te permite usar con descuento los servicios de empleado de Kafra: Primo d’Buffer, servicios VIP de teletransporte, 2 misiones de cacería de Abuelo y teletransportadores. Cuando termine el tiempo de espera, no podrás acceder de nuevo."
		},
		Summary = "*Nota: Este acceso no incluye las bonificaciones VIP de EXP, las ranuras para personajes adicionales ni el almacenamiento de 600."
	},
